(736, 739, 'Café Virginia ', 'Av. Vallarta #1949 Esquina con Juan Ruiz de Alarcón', 'es un nuevo espacio lleno de color, libros y cultura de todo el mundo que se refleja en su mural de la entrada dedicado a la escritora inglesa Virginia Woolf \ntambien se disfruta de una gran variedad de gastromomia en su estilo unico de café-restaurante.', '01 (33) 12015755', 14, 53, 1, 3, 1, 1317746075),
(737, 740, 'Das Bierhaus', 'Rio Nilo #7377-B', 'La misión de Das Bierhaus es proporcionar al cliente una agradable experiencia a través de alimentos y bebidas de calidad con un excelente servicio en un ambiente único con estilo alemán.\n\nAlgo significativo de Das Bierhaus son sus valores tales como la atención al cliente, el apoyo y respeto hacia las personas, la confianza y honestidad, la integridad, el trabajo en equipo, la innovación, la buen', '01 (33) 36015275', 14, 53, 1, 3, 3, 1317746500),
(738, 741, ' Scratch Do Ouro ', 'Prol. Av. Américas # 350 Código Postal: 45100 ', 'http://www.scratchdoouro.com.mx Exquisita gastronomia ven y disfruta de un buen servicio y de un buen sabor de voca. consiente a tu paladar.', '01 (33) 3633.9901  Fax: (33) 3833-1973', 14, 58, 1, 3, 2, 1317747947),
