(741, 744, 'Quimbaya ', 'Naciones Unidas 5485 casi esquina Juan Paloma y Arias. Colonia Vallarta Universidad.', 'A partir del 23 de Abril el Restaurante "Quimbaya" abrió sus puertas para atender a la comunidad colombiana en Guadalajara.\nUn espacio para interactuar con colombianos residentes en Guadalajara y Jalisco que quieran compartir noticias, información, mensajes y experiencias a toda la comunidad.\n', 'Pueden hacer sus reservaciones al tel: 3682 9635', 14, 63, 1, 3, 1, 1317749503),
(742, 745, 'Baraka', 'Av. Paseo de la Arboleda # 912 Col. Jardines del Bosque (entre Niños Héroes y Lázaro Cárdenas)', 'Baraka cuyo significado " Aliento de vida", es un lugar propicio para disfrutar de la mejor Cocina Mexicana Internacional.\n', '01 (33) 3122.0458', 14, 66, 1, 3, 1, 1317749659),
(743, 746, 'Bistro Garden', 'Av. López Mateos # 1360 esq. Lázaro Cárdenas', 'Es una excelente opción en la Ciudad de Guadalajara que responde a la preocupación creciente de las personas por "comer bien\n', '01 (33) 3770.6405', 14, 66, 1, 3, 1, 1317749723),
(744, 747, 'Cafe Cuatro', 'Av. Las Fuentes # 11', 'En sus inicios era una simple cafetería y ahora un restaurante en forma conservando la esencia de lo que es: un lugar para disfrutar y compartir \n', '01 (33) 3133.3748', 14, 66, 1, 3, 1, 1317749832),
(745, 748, 'Las Ánimas de Sancho', 'Pavo # 229 (Altos) Col. Centro', 'En un solo lugar puedes encontrar, además de un exquisito menú MEXICANO, artesanía huichol, un rincón chiapaneco donde deleitaras mermeladas, café de altura, chocolate orgánico, plantas exóticas , dulces, artesanía en bambú, libros, música en vivo y mucho mas!\n', '01 (33) 3614.3786', 14, 66, 1, 3, 1, 1317749919),
(746, 749, 'Mondo Sano', 'Volcan Etna #3050 a una cuadra de Patria', '"Fresco, agradable y muy limpio es una breve descripción de Mondo Sano, donde te ofrecemos gran variedad de platillos y un excelente servicio.\n\n"\n', '40009580', 14, 66, 1, 3, 2, 1317750005),
