(748, 752, 'Bechamel ', ' Pedro Moreno # 1429', 'Nuestro servicio es Altamente Profesional, nos preocupamos por nuestros clientes por Atenderles como solo ellos lo merecen.', ' 01 (33) 3825.9134', 14, 66, 1, 3, 1, 1317751512),
