(750, 754, 'EL RINCóN DE FRIDA ', 'Juan Palomar y Arias No.512 (antes Yaquis) casi esquina con Manuel Acuña. ', 'Cafe-Restaurant-Galeria\n\nUn Rinconcito acogedor en donde podras disfrutar de la deliciosa comida mexicana, de un rico Café Orgánico de Colima, con el que preparamos Cafe De Olla y nuestro especial Cafe Lechero y Vinos de Mesa, tambien podras disfrutar de la Galeria dedicada a Frida Kalho. ', '3642 0249', 14, 78, 1, 3, 1, 1317752204),
(751, 755, 'Fonda Lisboa ', 'NARANJO 1402 COL DEL FRESNO', 'LONCHES DE PIERNA, CENADURIA, ANTOJITOS MEXICANOS', 'Teléfonos: - 38129079', 14, 66, 1, 3, 1, 1317752685),
(752, 756, '"Irma Corajes La unica  "', 'Chicago # 1280-B Col. La Aurora Ferrocarril Guadalajara - Jalisco - CP: 44440', 'La verdadera corajes tiene para usted las mejores carnes asadas de México, sus exquisitos platillos mexicanos y su sazón en cada platillo ya que todo está cocinado por ella misma.\nEstamos de Martes a Domingo de 8:00 am. A 4:00 pm.', '01 (33) 1380.0810', 14, 78, 1, 3, 1, 1317752963),
(753, 757, 'La Antigua', 'Morelos # 371 frente a Plaza Guadalajara, Fte. a Catedral', 'Un rinconcito del viejo Guadalajara; un espacio donde te sentirás de nuevo en las épocas donde la ciudad era libre de tráfico, ruido y metrópoli como lo es en la actualidad; aquí encontraras la mejor cocina mexicana muy a nuestro estilo. Desde la comida típica y tradicional hasta la más alta cocina de nuestro país.', '01 (33) 3563.6570', 14, 78, 1, 3, 1, 1317753454),
(754, 758, 'La Casa de los Moles ', 'Diagonal Isabel Prieto 766 esquina Av. Américas Ladrón de Guevara', 'Comida 100% mexicana, se elabora al momento para obtener la mejor calidad en sus alimentos\nespecialidad: mole de piña, tamarindo y cacahuate\nSalon de Eventos\nReservaciones\nmusica ambiental\naceptan tarjetas\nlun a sab 8 a 18 hrs\ndom 9 a 18 hrs ', 'Tel: (33) 36427064', 14, 78, 1, 3, 1, 1317753745),
(755, 759, 'Los Arcángeles ', 'Av. México # 2727 Col. Vallarta Norte', 'El mejor servicio solo para ti.', '01 (33) 3669.0613', 14, 66, 1, 3, 1, 1317754045),
(756, 760, 'Los Chilaquiles', 'Av. Lázaro Cárdenas # 2729', 'Los chilaquiles nos hemos dado la tarea de rescatar recetas de la cocina antigua mexicana utilizando ingredientes que solo se pueden encontrar en los pintorescos pueblitos de jalisco y hemos encontrado asi la especialidad de la casa.', '01 (33) 3647.8773', 14, 78, 1, 3, 1, 1317754390),
(757, 761, 'Sabor Brazil ', 'Felipe Ruvalcaba # 6084 esq. Tomás Balcazar Col. Paseos del Sol', 'date un buen gusto', '01 (33) 3125.2555', 14, 66, 1, 3, 1, 1317754819),
(758, 762, 'Sandys Hospital San Javier ', 'Pablo Casals # 640 esq. Manuel Acuña. Col. Providencia', 'Lo que más nos recomienda en desayunos son los clásicos chilaquiles tronadores de nuestra ciudad; o bien, nuestras exquisitas especialidades como la Arrachera, Pechuga Principe Erick o la Ensalada César con Pollo que tanto nos distingue. Ofreciendo el mejor servicio anticipado y personalizado, con la más alta calidad en nuestros productos 100% naturales.', '01 (33) 3669.0222', 14, 66, 1, 1, 2, 1317754950),
(759, 763, 'Yuambú ', 'Plaza del Sol Local 13-B', 'Algo tranquilo y delicioso para consentirte solo para ti', '01 (33) 1201.1648', 14, 66, 1, 3, 2, 1317755293),
(760, 764, 'La Noche Azul', 'Av. López Mateos Norte # 800', 'Un restaurant agradable para cenar en un ambiente de intimidad con un menú fresco y alimentos de alta calidad. fondues originales con quesos europeos adaptados al zazón mexicano.', '01 (33) 3630.0337', 14, 69, 1, 3, 1, 1317755719),
(761, 765, 'Hostería del Ángel', '5 de Mayo # 260', 'El buen gusto de consentir un paladar unico', '01 (33) 3656.9516 y 3833.2180', 14, 73, 1, 3, 1, 1317755914),
(762, 766, 'Il Tavoloslovensko ', 'Quetzalcóatl # 665', 'DISFRUTA DE BUENA MUSICA ... BUENA COMPAÑIA... BUENA COMIDA', '01 (33) 3647.8000', 14, 74, 1, 3, 1, 1317756526);
INSERT INTO `altanegocio` (`altaNegocioId`, `altaNegocioNegocioId`, `altaNegocioNombre`, `altaNegocioDireccion`, `altaNegocioDescripcion`, `altaNegocioColonia`, `altaNegocioGiro`, `altaNegocioSubgiro`, `altaNegocioPais`, `altaNegocioEstado`, `altaNegocioCiudad`, `altaNegocioFechaCreacion`) VALUES
(763, 767, 'KLÖB recompensa vivir tu vida!!!', '', 'UNICO MULTINIVEL EN EL QUE NO HAY UN PRODUCTO QUE TENGAS QUE VENDER, NADIE VENDE NADA NI VENDES NADA Y  RECUPERACION DE INVERSION EN HORAS Y  GRANDES INGRESOS RESIDUALES EN POCO TIEMPO,  TRABAJANDO  DE 1 A 2 HORAS DIARIAS.', '', 11, 145, 1, 2, 1, 1317756801),
(764, 768, 'Ostería Da Toni ', 'Av. Niños Héroes # 3000-A', 'El gusto de tu paladar', '01 (33) 3121.8364', 14, 73, 1, 3, 1, 1317756974),
(765, 769, 'Argentilia', 'Av. Américas # 840 esq. Jose Maria Vigil Col. Jesús García', 'Llega a la ciudad de Guadalajara el restaurante Argentilia, mismo que forma parte del Grupo Argentilia- Frascati, ubicados en las ciudades de León, Querétaro, Aguascalientes, Guanajuato, Irapuatoy la Cruz de Huanacaxtle, con una trayectoria de 12 años.Contamos con excelentes instalaciones, las cuales constan de un salón con aire acondicionado, una magnifica terraza, además de un salón privado.\n', '01 (33) 3640.1498', 14, 56, 1, 3, 2, 1317757387),
(766, 770, 'Cuatro Patas', 'Miguel de Cervantes Saavedra #112 entre López Cotilla y La Paz. Col. Lafayette.', 'Hoy buscamos comer bien sin gastar tanto. Si bien, somos exigentes en buscar un lugar agradable, bien ubicado y con una oferta atractiva en su menú, nos gusta que nos sorprendan con nuevos platillos, buenos detalles en el servicio desde que llegamos y esos detalles que nos hacen decir: ¡me encanta este lugar! \n', '(33) 36150400', 14, 56, 1, 3, 1, 1317757481),
(767, 771, 'Tartufo', 'Av. La Paz #1750 Col. Americana', '"Una de las bonitas casas con influencia europea de la Colonia Americana está ambientada como restaurante.Tartufo nos ofrece una excelente opción para disfrutar de la cocina italo-argentina en ambiente tranquilo.\n"\n', '(33) 1562.4008', 14, 56, 1, 3, 1, 1317757566),
(768, 772, 'Al Khaima Restaurante ', 'Lerdo de Tejada # 2069 Entre Marsella y Chapultepec Col. Lafayette', 'gastronomia marroquina la diferencia del gusto y un placer.', '01 (33) 3616.5822', 14, 77, 1, 3, 1, 1317757818),
(769, 773, ' Alta Fibra ', 'Prisciliano Sánchez # 370 B', 'comer sano es comer rico', '01 (33) 3124.1510', 14, 87, 1, 3, 1, 1317758078),
(770, 774, 'El Buen Sabor ', 'Morelos # 1889-B', 'el buen sabor es nuestra especialidad ', '01 (33) 3124.6584', 14, 87, 1, 3, 1, 1317758491),
(771, 775, 'El Jardín', '01 (33) 3825.6885', 'El Restaurante Jardín es un espacio de degustación único en la gastronomía de Mallorca. Ofrece una cocina mediterránea auténtica, cocina de mercado, cocina de autor, que une tradición y vanguardia aplicando a los productos autóctonos de la isla las técnicas más avanzadas.', '', 14, 77, 1, 3, 1, 1317758785),
(772, 776, 'El Señor Sol ', 'Vidrio #1967, Guadalajara, ', 'Comida Ovolacto-Vegetariana 100% Casera, comida corrida inlcuye 1 ensalada, sopa o crema, plato fuerte, té, agua fresca y pan hecho en casa', 'Teléfono	 38266497', 14, 87, 1, 3, 1, 1317760569),
(773, 777, 'Jugos Santa Tere', 'Pedro Buzeta # 417', '', '01 (33) 3825.8208', 14, 87, 1, 3, 1, 1317760691),
(774, 778, 'Mundo Fresco ', 'Plaza Eximoda Local 15-F', 'vida mas rica, vida mas saludable te ofrecemos un excelente servicio ', '01 (33) 3122.5182', 14, 87, 1, 3, 1, 1317761103),
(775, 779, '"Ravissant  "', 'Plaza del Sol local A6', '', '01 (33) 1201.9503', 14, 87, 1, 3, 1, 1317761604),
(776, 780, 'Risto Barra Gourmet', 'Av. Terranova esq. Turín', 'Risto es un lugar donde se come bien, como en casa, fresco, rico, ligero, con la mejor selección de ingredientes naturales y recetas de alta cocina, donde valoramos el servicio, la comida y el espacio; comiendo a un precio justo y accesible.', '01 (33) 3641.2125', 14, 87, 1, 3, 2, 1317761743),
(777, 781, 'Super Salads ', 'Av. Guadalupe # 625', 'Llega a Super Salads la mejor manera de disfrutar el buen vivir ', '01 (33) 3344.7999', 14, 87, 1, 3, 2, 1317761910),
(778, 782, 'Titas', 'Av. Tepeyac # 591', 'lo mas saludable Las frutas de las Titas se apoderan de otro rinconcito de la ciudad, aquí no hay apuros, un equipal lo espera en sus cómodas fauces, también las complacencia', '01 (33) 3122.9970', 14, 87, 1, 3, 2, 1317762133),
(779, 783, 'Zanahoria ', 'Av. Américas # 332', '', '01 (33) 3616.6161', 14, 87, 1, 3, 2, 1317763802),
(780, 784, 'Baraka', 'Av. Paseo de la Arboleda # 912 Col. Jardines del Bosque (entre Niños Héroes y Lázaro Cárdenas)', 'Baraka cuyo significado " Aliento de vida", es un lugar propicio para disfrutar de la mejor Cocina Mexicana Internacional.\n', '01 (33) 3122.0458', 14, 78, 1, 3, 1, 1317763920),
(781, 785, 'Canelos Bugambilias', 'Av. López Mateos Sur # 7777 Bugambilias', 'Canelos cuenta con las mejores y más bonitas instalaciones a su completa disposición, y por supuesto!!!... el gran servicio y sabor auténtico campestre que nos caracteriza\n', '01 (33) 3684.4723', 14, 78, 1, 3, 2, 1317763970),
(782, 786, 'Excalibur', '12 de Diciembre # 3070', 'El pasado 6 de Enero Excalibur abrió sus puertas para ofrecer a sus comensales un menú de cortes finos a precios accesibles, donde se busca llevar el taco a un grado gourmet. Los socios, llenos de inquietudes e ilusiones de tener un restaurante donde pudieran dar un servicio inmejorable decidieron emprender esta gastronómica aventura\n', '01 (33) 3647.0017', 14, 78, 1, 3, 1, 1317764026),
(783, 787, 'La Mitotera', 'Av. Unión # 496 esq. Vidrio Col. Lafayette', 'Lugar mágico de ensueño, lleno de color y el aroma de México, incluido su folclor. La mitotera  es llegar a  casa de un amigo donde podrás descansar tranquilamente en sofás entre  árboles y estrellas; charlar acompañado de un buen café de olla, en compañía de un buen libro y el sonido de las fuentes como testigo en un  rinconcito freso y lleno de color. Jugar y divertirte con los amigos una buena ', '01 (33) 1204.1929 y 3563.5315', 14, 78, 1, 3, 1, 1317764105),
(784, 788, 'Las Ánimas de Sancho', 'Pavo # 229 (Altos) Col. Centro', 'En un solo lugar puedes encontrar, además de un exquisito menú MEXICANO, artesanía huichol, un rincón chiapaneco donde deleitaras mermeladas, café de altura, chocolate orgánico, plantas exóticas , dulces, artesanía en bambú, libros, música en vivo y mucho mas!\n', '01 (33) 3614.3786', 14, 78, 1, 3, 1, 1317764165),
(785, 789, 'Los Dos Molinos', 'Lerdo de Tejada #2069', 'Los Dos Molinos es un concepto que surgió hace 35 años en Arizona, pronto se popularizó en la región, por lo que se abrieron otras sucursales dentro del mismo estado. Tiempo después llegó a la ciudad de Nueva York y hace poco se abrió la primera sucursal en México\n', '36152833', 14, 78, 1, 3, 2, 1317764232),
(786, 790, 'Arracheras la Silla', 'Av. Guadalupe #4688 esq. Catalina de Sienna', 'Ven a disfrutar de un exquisito sabor mexicano y gran variedad en nuestros platillos para satisfacer a paladares como el tuyo', '01 (33) 3122.1006', 14, 78, 1, 3, 2, 1317764410),
(787, 791, 'Ay Carbón! ', ' Av. Clouthier # 699-C', 'Ay Carbón! Se dedica a los cortes, camarón y pollo, su especialidad y distinción es El Leñito: preparado sobre una tortilla de harina untada de frijoles refritos, un corte arrachera, $60; rib eye $65, pollo a la parrilla o bbq ($55), o camarón a la parrilla $70, este delicioso leñito se prepara al gusto del cliente y puede acompañarse con papas a la francesa o ensalada. ', '01 (33) 3125.6334', 14, 78, 1, 3, 2, 1317764533),
(788, 792, ' Birrieria Las 9 esquinas ', 'Colón, Col. Centro', 'Aqui disfrutaras del gran sazón de la comida mexicana', '01 (33) 3613.6260', 14, 78, 1, 3, 1, 1317764761),
(789, 793, 'Casa Bariachi', 'Av. Vallarta # 2221', 'Abrió sus puertas en el año de 1995 motivado por proporcionar a la ciudad de Guadalajara cuna del Mariachi y folklore de México, un lugar digno donde jóvenes, adultos y visitantes de todo el país y del mundo puedan disfrutar la tradición de México, haciendo de cada día una verdadera Fiesta Mexicana.', '01 (33) 3615.0029', 14, 78, 1, 3, 1, 1317764863),
(791, 795, 'Servicios de Seguridad Personal en Colima', 'Av. Tecnológico No, 52 Int. 101', 'Alarmas, equipos antisecuestro, localizadores,cámaras IP, cercas eléctricas, accesorios, botón de pánico.... ', 'Oficinas Nova', 16, 99, 1, 2, 7, 1317766490),
(792, 797, 'El Fuerte ', 'Félix Palavichini # 2280', 'Restaurante Bar el Fuerte ofrece comida a la carta, extenso surtido en bebidas nacionales e importadas, musica toda la semana\n', '01 (33) 3823.3883', 14, 78, 1, 3, 1, 1317825325),
(793, 798, ' El Ganadero ', 'Av. Américas # 364', 'Excelente la atención y las carnes son exquisitas. Ideal para solos o grupos\n', '01 (33) 3615.9063', 14, 78, 1, 3, 1, 1317825460),
(794, 799, 'El Gran Rodeo ', 'Carretera Libre a Zapotlanejo Km. 5', 'Aquí puedes degustar de la gran comida mexicana\n', '01 (33) 3690.0965', 14, 78, 1, 3, 1, 1317825780),
(795, 800, 'El Mesón del Rey ', 'Calz. Independencia sur # 162', 'La historia de la propia trayectoria gastronómica del Mesón del Rey arranca allá por el año 87, por entonces la familia Morales Borrás traslada sus esfuerzos e ilusiones a lo que hoy es conocido como el "mesón" después de toda una vida dedicada a la hosteleria.  A lo largo de estos años y más concretamente al incorporarse las segunda generación familiar en la persona de su hijo Pablo, el restauran', '01 (33) 3613.9775', 14, 78, 1, 3, 1, 1317825883),
(796, 801, ' El Mexicano ', 'Morelos # 79', 'Restaurant "El Mexicano"  fue fundado el 16 de septiembre de 1992 por el C.P. Manuel Rivera Ramírez.\n', '01 (33) 3658.0217', 14, 78, 1, 3, 1, 1317825960),
(797, 802, 'El Refugio del Fraile ', 'López Mateos # 4028 Col. Las Fuentes', 'El Refugio del Fraile restaurant, ofrece la mejor variedad de alimentos y bebidas en su especialidad, así como un excelente servicio y atención de primera. Siempre con el mejor precio y atención a sus comensales. ', ' 01 (33) 3133.9700', 14, 78, 1, 3, 1, 1317826422),
(798, 803, 'El Sacromonte ', 'Pedro Moreno # 1393', 'Disfrutaras de la nueva cocina mexicana, platillos elaborados con ingredientes de la mas alta calidad. seleccionados por nuestros chefs, respetando todas las recetas que han pasado de generación en generacón a través de más de 4 décadas.', '01 (33) 3825.5447', 14, 78, 1, 3, 1, 1317827815),
(799, 804, 'Hacienda Jazo ', 'Justo Sierra # 2022', 'HACIENDA JAZO La de más tradición en Guadalajara fundada en 1970 y siguen abiertos con el mismo servicio y calidad, con auténtica comida Mexicana. Atendida personalmente por los Jazo, ya son 3 generaciones y siguen haciendo una de las mejores comidas mexicanas en Guadalajara, de acuerdo a las más estrictas reglas de hospitalidad, servicio y calidad Tapatía', '01 (33) 3616.8280', 14, 78, 1, 3, 2, 1317828033),
(800, 805, ' La Antigüita ', 'Av. Mariano Otero # 5529', 'Un rinconcito del viejo Guadalajara; un espacio donde te sentirás de nuevo en las épocas donde la ciudad era libre de tráfico, ruido y metrópoli como lo es en la actualidad; aquí encontraras la mejor cocina mexicana muy a nuestro estilo. Desde la comida típica y tradicional hasta la más alta cocina de nuestro país.', '01 (33) 3632.4100', 14, 78, 1, 3, 1, 1317828259),
(801, 806, 'La Casa del Gordo ', 'Manuel Cambre # 1967 Lienzo Charro Ignacio Zermeño', 'Gracias al acogedor ambiente que ofrecen sus instalaciones con equipales La Casa del Gordo se antoja tanto para realizar una comida de negocios como para llevar a la familia el fin de semana sin olvidar el rato agradable que se puede convivir con los amigos al ver un partido de fútbol a través de la transmisión en pantallas plasmas y pantalla de gran formato. ', '01 (33) 1593.7032', 14, 78, 1, 3, 1, 1317828417),
(802, 807, 'La Chata', 'Corona # 126', 'En la gloriosa época de los trovadores y calandrias en el corazón de la ciudad de Guadalajara, los aromas de la tierra mojada, el vuelo de las palomas y el romanticismo en sus calles y plazas, invitaban por las tardes a saborear una deliciosa tostada o los típicos taquitos dorados para culminar un día de arduo trabajo, con una agradable charla en las improvisadas cenadurías hogareñas de algún zagu', '01 (33) 3613.0588', 14, 78, 1, 3, 1, 1317828679),
(803, 808, 'La Chuza ', 'Fernando de Celada # 2856 esq. Golfo de Cortés', 'Una delicia en todos nuestros platillos, para consentir a nuestros clientes', '01 (33) 3616.5630', 14, 78, 1, 3, 2, 1317828957),
(804, 809, 'La Delgadina ', 'Av. Vallarta # 3168', 'un buen sabor para nuestros paladares ', '01 (33) 3122.4978', 14, 78, 1, 3, 1, 1317829082),
(805, 810, 'La Enramada ', 'Av. López Mateos sur # 2032', 'un acogedor y agradable lugar donde todos se sentiran como en casa', ' 01 (33) 3684.1966', 14, 78, 1, 3, 2, 1317829348),
(806, 811, ' La Faena ', 'Gigantes # 1552', 'FORCLORICOS DE LA CANCION MEXICANA CANTASTES Y MAS DESPUES DE A BARIEDAD DISFRUTE CON SU PAREJA O AMIGOS DE BAILES DEL MOMENTOS NORTEÑOS SALSA MERENGE CANCIONES PARA DISFRUTAR   Y GRUPOS VERSATILES DOS BARIEDADES 5PM Y 9:30 PM SEGIDAS DEL BAILE CARNES ROJAS Y MARISCOS Y FRUTA PICADA POR  CORTECIA DE LA CASA TENEMOS PROMOCIONES EN BOTELLAS NACIONALES E IMORTADAS SERBESAS RESTAURANTES 100�MILIARES  ', ' 01 (33) 3649.0421', 14, 78, 1, 3, 1, 1317829541),
(807, 812, 'Las Flautas', ' Av. Providencia # 1584', 'Tipica cocina mexicana con un buen sazón para tu delicado paladar y un excelente servicio para nuestros clientes.', ' 01 (33) 3817-1741', 14, 78, 1, 3, 2, 1317839234),
(808, 813, ' La Gorda ', 'Av. Guadalupe # 1569', 'ranscurría el año de 1956, cuando una tarde de septiembre, en la ciudad de Guadalajara, Jalisco, en el popular barrio de Santa Teresita, sobre las calles de General Coronado y Juan Alvarez, un matrimonio muy joven formado por Josefina García -nombrada de cariño “Gorda”- y Marcelino Rodríguez “Machelo”, emprendieron un negocio callejero con la ayuda de su tía abuela Doña Hildeliza Ruvalcaba, a quie', ' 01 (33) 3647.7133', 14, 78, 1, 3, 1, 1317841605),
(809, 814, 'La Tequila ', 'Av. México y Napoleón', 'Acceso para silla ruedas, Área de fumar, Bar completo, Comida al aire libre, Restaurante bar, Sala para fumar.  El restaurante ofrece eventos semi-privados con una capacidad de 15 personas. En horario de comida eventos particulares hasta para 150 personas.', '01 (33) 3640.3110', 14, 78, 1, 3, 1, 1317842119),
(810, 815, 'La Terraza de la Abuela ', 'Prol. Américas #1550 Col. Altamira', 'La Terraza de La Abuela es un cálido restaurante dedicado a la preparación de comida mexicana, con un excelente sabor casero. Su ambiente es familiar e informal, en donde se disfruta de sus jardines, cascadas, plantas y aves. Esta a disposición de todo aquel que desee ser nieto adoptivo de La Abuela, los 365 días del año.', '1202.2580 y 81 ', 14, 78, 1, 3, 1, 1317848403),
(811, 816, 'Las Hermanas Coraje ', 'Rinconada de las Praderas # 1301', 'Platos típicos bien caseros para degustar en un ambiente cálido y amable., Buena cocina con sazón casero y unas tortillas recien hechas deliciosas', '01 (33) 3671.4717', 14, 78, 1, 3, 1, 1317848746),
(812, 817, 'Manolos Campestre ', 'Av. Mariano Otero # 1510', 'Con la tradicion, servicio y sabor que siempre han caracterizado a los Restaurantes Manolos.\n\n"Manolo Campestre" se transforma y se renueva ofreciendo un espacio unico en confort, sabores y ambientacion que deleitan los sentidos con un nuevo concepto mexicano contemporaneo. ', '01 (33) 3122.2244 y 3123.3083', 14, 78, 1, 3, 1, 1317849031),
(813, 818, 'María Bonita ', 'Av. Vallarta esq. Niño Obrero', 'María Bonita lleva en su gastronomía rasgos de lo que era la Doña, presentando una propuesta única de la riqueza y exquisitez de la cocina mexicana y a la vez, la sazón única de las abuelitas, con recetas de antaño, algunas de ellas pertenecientes a la gastronomía prehispánica, como el pato confitado "la mujer pájaro".\n   Desde que se entra, el ambiente creado por los materiales usados en su decor', '01 (33) 3134.2424 ext. 2421', 14, 78, 1, 3, 1, 1317849442),
(814, 819, 'Mexicanisimo ', 'Quetzalcóatl # 522', '¡Mexicanisimo con un ambiente muy Mexicano! ...', '01 (33) 3122.1065 y 3647.1100', 14, 78, 1, 3, 1, 1317850069),
(815, 820, 'Ta Copetón ', ' Av. Patria # 585 entre San Luis Gonzaga y Sto. Tomás', 'Ta’Copetón es un restaurante con un concepto de decoración alegre, de ambiente familiar, ofreciendo comida mexicana, especialmente en variedad de tacos y carnes a la parrilla.', ' 01 (33) 3682.1164', 14, 78, 1, 3, 1, 1317851210),
(816, 821, 'Taquería Minerva ', 'Av. Vallarta # 2982', 'Los mejores tacos mexicanos como nunca lo habias provado', '01 (33) 3630.0954', 14, 78, 1, 3, 1, 1317851370),
(817, 822, 'Tortas Clement''s ', 'Aurora # 145 esq. 12 de Diciembre Col. Chapalita', 'Rara vez pensamos en la comida, como un medio para viajar… Los sabores, texturas, lugares y olores son, sin lugar a dudas un catalizador de la mente. Al seguir mi búsqueda por las diversas tortas ahogadas, no podía dejar de ir a uno de mis lugares favoritos. Tortas Clements. Sin embargo y para mi sorpresa, me veo en un dilema a la hora de emitir mi juicio al respecto. No por la buena o mala calida', '01 (33) 3121.4064', 14, 78, 1, 3, 2, 1317851506),
(818, 823, 'Applebee''s', ' Plaza Galerías 360, primer piso', 'se te va antojar probar los platillos mas deliciosos...  escuchalos llegar a tu mesa!!! \n', '01 (33) 3673.4912', 14, 54, 1, 3, 1, 1317852755),
(819, 824, 'Chili''s ', 'Centro Magno', 'Muy buen lugar para ir a comer junto con la familia o en pareja. Ademas de una jugosa variedad de carnes rojas, tambien pueden encontrar pescado, salmon, camarones a la parrilla. Pero ademas de ir por la comida a este lugar yo voy por el postre; el famoso MOLTEN CHOCOLATE CAKE tienen que probarlo esta delicioso.', '01 (33) 3616.5216', 14, 54, 1, 3, 1, 1317853032),
(820, 825, 'Jockey ', 'Pablo Casals & Quebeq', 'Un lugar formal, cómodo con influencia en su cocina de la costa este de los Estados Unidos en donde Usted puede disfrutar Mariscos, Pescados y Cortes Americanos en un ambiente acogedor y elegante.', '01 (33) 3642.6765', 14, 54, 1, 3, 1, 1317853122),
(821, 826, 'El Alazán y el Rosillo', 'Carr. libre a Los Altos # 317', 'es un lugar canprestre y con mariachi en el que puedes pasar todo el dia muy agradable', '01 (33) 3690.1558 y 3690.1686', 14, 60, 1, 3, 1, 1317854595),
(822, 827, '"La Casa del Gordo  "', 'Manuel Cambre # 1967 Lienzo Charro Ignacio Zermeño', 'Gracias al acogedor ambiente que ofrecen sus instalaciones con equipales La Casa del Gordo se antoja tanto para realizar una comida de negocios como para llevar a la familia el fin de semana sin olvidar el rato agradable que se puede convivir con los amigos al ver un partido de fútbol a través de la transmisión en pantallas plasmas y pantalla de gran formato. ', '01 (33) 1593.7032', 14, 60, 1, 3, 1, 1317854787),
(823, 828, 'Parrilla Bar El Tajo', 'Prol. López Mateos Sur Km. 15', 'Parrilla Bar El Tajo fue fundado en 1990 por una inquietud de la familia Montes que tenían un terreno en Tlajomulco donde se iban a pasar algunos fines de semana para disfrutar de la naturaleza, la familia y la buena convivencia. De estos momentos familiares nació la idea de poner un restaurante con cierta influencia argentina donde la gente pudiera pasar un rato agradable, en un ambiente familiar', '01 (33) 3686.0912', 14, 60, 1, 3, 1, 1317855086),
(824, 829, 'China Inn', 'Av. Niños Héroes # 2970-4', 'lo mejor de la comida china en tu boca', '01 (33) 3121.8384', 14, 61, 1, 3, 1, 1317855243),
(825, 830, 'Chiu Yion ', 'Av. Alcalde # 283', 'AUTENTICA COMIDA CHINA, COMIDA CANTONESA, AVES, RES, CERDO, MARISCOS, CAMARON, PESCADO, POLLO, SOPA, ARROZ, TALLARINES, VEGETALES, POSTRES, CERVEZA, VINOS, MUSICA', '01 (33) 3614.3154', 14, 61, 1, 3, 1, 1317855628),
(826, 831, 'Chong Wah', ' López Cotilla # 370', 'un buen lugar para degustar un buen platillo', '01 (33) 3613.0033', 14, 61, 1, 3, 1, 1317855854),
(827, 832, 'Comida Oriental Lumpur ', '"Plaza Tepeyac, loc F6 "', 'nuestra especialidad son nuestros clientes por eso tenemos para ellos una gran variedad de exquisitos platillos', '01 (33) 3620.7571', 14, 61, 1, 3, 1, 1317855997),
(828, 833, 'Dragón de Oro ', 'Av. Américas # 1637', 'algo diferente que no puedes dejar de conocer, ven a disfrutar de nuestros deliciosos platillos.', '01 (33) 3817.1655', 14, 61, 1, 3, 1, 1317856298),
