(841, 846, 'Il Diavolo', 'Av. Terranova # 1189 esq. Turín Col. Providencia', 'Pizzas, ensaladas y panini acompañados de un buen vino, es lo que te ofrecemos en "il diavolo".\n', '01 (33) 3640.0785', 14, 67, 1, 3, 2, 1317916168),
(842, 847, 'La Gondola', 'Lorenzo Barcelata # 513 Ciudad Bugambilias', 'La Góndola promete ofrecer a sus clientes el sabor que los hará sentir que están en la bella Italia. Esta ubicada en una tranquila plaza comercial dentro de la exclusiva zona de Ciudad Bugambilias, su diseño es sencillo pero elegante lo que evoca a las originales pizzerías italianas.\n', '01 (33) 3684.8393', 14, 67, 1, 3, 2, 1317916222),
(843, 848, 'Deli Salads Express ', 'López Cotilla # 1551', 'Deliciosas, muuuuy bien servidas, con excelente variedad de ingredientes y aderezos, los baguettes muy llenadores. Y el té con un excelente sabor.\nEntras con un antojo, y sales contento', '01 (33) 3630.5687', 14, 67, 1, 3, 1, 1317916393),
(844, 849, 'Queen Salads & more ', 'López Mateos Sur # 3911 Loc. 16', 'Sinceramente las mejores ensaladas de Guadalajara en el rango de su precio. ', '01 (33) 3693.0000 y 01', 14, 67, 1, 3, 2, 1317916686),
(845, 850, 'San Francisco Salads Co. ', 'Nueva Escocia # 1486 Loc. 14', '“SAN FRANCISCO SALADS CO” es una empresa de alimentos de alta calidad, frescos y saludables; en un ambiente vanguardista, temático y práctico. ', '01 (33) 3640.9000 y 0063', 14, 67, 1, 3, 1, 1317916839),
(846, 851, 'Sushi & Salads ', 'Av. Guadalupe # 1577', 'El mejor lugar para comer sushis!! Ambiente fresco, gran variedad en platillos y lo mejor es el 3x3!! 100% recomendable', '01 (33) 3647.6458', 14, 67, 1, 3, 1, 1317917012),
(847, 852, 'Cabernet ', 'Pablo Neruda # 3180-A esq. Nueva Escocia Col. Providencia', 'Abrió sus puertas uno de los mejores restaurantes en Guadalajara así que no te lo puedes perder, creo que ya sabes de que te hablamos es el delicioso restaurante de Cocina Francesa Fusión “Cabernet”.', '01 (33) 3640.2224', 14, 70, 1, 3, 1, 1317917235),
(848, 853, 'Chez Nene', 'Juan Palomar y Arias # 426', 'COMIDA, CENA, HORARIO FRANCES, COMIDA FRANCESA, ESTACIONAMIENTO, PROPIO, VALLET PARKING, PATO, JABALI, VENADO, FILETE, PESCADOS Y MARISCOS DEL DIA, SOPAS, ENSALADAS, POSTRES', '01 (33) 3673.4564', 14, 70, 1, 3, 2, 1317917482),
(849, 854, 'Chez Pierre ', 'Av. España # 2095', 'Su cocina es muy deliciosa los camarones en salsa d Mango es mi platillo preferido, las cremas todas son ricas y los postres, ademas del ambiente tan romantico q hacen con musica de fondo de piano y un saxofón es de lo mas padre.', '01 (33) 3615.2212', 14, 70, 1, 3, 1, 1317918153),
(850, 855, 'Circulo Francés ', 'Av. López Cotilla # 1221', 'es una empresa mexicana especializada en el buen gusto de la gente para disfrutar de un buen lugar y una gastronomia exquisita', '01 (33) 3825.0515', 14, 70, 1, 3, 1, 1317918429),
