(1017, 822, 0, 0, 'Paseos en Calandria', '227', 1318464000, 1325289600, NULL, '9:00 pm', 'Estos paseos van por las calles antiguas o por la zona comercial de Guadalajara.\nA principios del siglo XX aparecen estos coches de alquiler que son unas carretas con capota plegable arrastradas por un corcel; en aquella época se mandaron pintar de negro con las ruedas amarillas, por lo que la gente las conoce hasta hoy como Calandrias.', 1318464000, 'Afuera del Museo Regional (Liceo, entre Av. Hidalgo e Independencia).', 'Afuera del Museo Regional (Liceo, entre Av. Hidalgo e Independencia).', NULL, 0, 796, 796, 72, '0', 0),
(1024, 822, 0, 0, 'Dinosaurios terribles visitantes del cretácico', '0', 1318464000, 1323907200, NULL, '6:30 pm', 'Gran parte de esta exposición fue reunida por el ingeniero Solórzano, recolectada en el Occidente de nuestro país y en numerosa localidades de nuestro estado. En esta región se conocen al menos 29 sitios que abarcan épocas de 136 millones de años, con una diversidad de, por lo menos 130 especies vegetales y animales. Entre los lugares fosolíferos de Jalisco se encuentran Colotlán, Teocaltiche, San Juan de los Lagos, Ssan Cristobal de la Barranca, Amatitán, Zapopan, Guadalajara, Atotonilco El Alto, Mascota, Ameca, Tepehuaje, Acatlán de Juares, Cocula Tecolotlán, Atotonilco El Bajo, Zacoalco de Torres, Laguna de Chapala, Teocuitatlán de Coronado, Juchitlán, Tomatlán, Ejutla, Tapalpa, Ciudad Guzmán y Tamazula de Gordiano.', 1318464000, 'Museo de Paleontología de Guadalajara ', 'Museo de Paleontología de Guadalajara ', NULL, 0, 796, 796, 77, '0', 0),
(1151, 822, 0, 0, 'Mercadotecnia Patria: Los grandes festejos del Centenario 1910 	  Cerrar', '385', 1318982400, 1295049600, NULL, '6:00 pm', 'El pasado 12 de septiembre se inauguró la exposición Mercadotecnia Patria: Los Grandes Festejos del Centenario 1910.\nLa muestra, que permanecerá abierta en este espacio hasta el 15 de enero de 2012, es una crónica visual que narra la historia de México y la conformación de su identidad permitiéndonos comprender distintas perspectivas y concepciones sobre la vida política, social y cultural de nuestro país.\nCon sus 401 piezas, entre las que destacan fotografías, óleos, grabados, litografías, platos ornamentales, libros, boletos e invitaciones a los festejos y demás objetos de la época, Mercadotecnia Patria ofrece un recuento histórico de las celebraciones oficiales de mayor esplendor que se hayan realizado en el país y con las que Porfirio Díaz conmemoró los primeros 100 años de vida independiente de México.', 1318982400, 'Centro Cultural Casa Vallarta', 'Centro Cultural Casa Vallarta', NULL, 0, 796, 796, 112, '0', 0),
(1251, 1, 0, NULL, 'Reunion en El Refugio del Fraile ', '0', 1319155200, NULL, '12:00 pm', NULL, 'liyri7tfiyriuygti6roiuyi75ei769758', 1319219136, 'El Refugio del Fraile ', 'López Mateos # 4028 Col. Las Fuentes', '4,2,9,741,1,', 1, 802, 0, 1, '0', 0),
(1302, 822, 0, 0, 'El sueño que canta la tierra', '556', 1319500800, 1323388800, NULL, '6:00 pm', 'Fotografías de Enrique Carrasco sj. Entrada gratis con tu entrada al bosque.\nEn esta exposición se muestran 23 fotografías de Enrique Carrasco sj, sobre los “susurros” de la Madre Tierra, algunos de lamento y dolor, otros de alegría y esperanza. Así él nos da a conocer algunos aspectos de esta relación de amor y respeto de los pueblos indígenas con la Naturaleza, para que aprendamos de ellos y busquemos en comunidad cambios a favor de nuestras vidas y de nuestra Madre Tierra.\nCuradora: Mariana Sainz Navarro\nDiseño: Rocío Lizola\nMontaje: Mariana Madrigal\nGestión: The Wake Cup', 1319500800, 'Bosque Los Colomos, Las Pérgolas (Junto al Jardín Japonés) ', 'Bosque Los Colomos, Las Pérgolas (Junto al Jardín Japonés) ', NULL, 0, 796, 796, 189, '0', 0),
(1342, 946, 0, 0, 'Coral Divas de la Universidad de Colima', '0', 1319587200, 1319587200, NULL, '10:30 pm', 'El grupo Voces femeninas está integrado por adolescentes es dirigido por la maestra Agustina Murguía. La cita es en el Foro Pablo Silva García el 5 y 26 de octubre a las 19:00 horas.\n\n', 1319587200, 'Foro Pablo Silva Garcia ', 'Foro Pablo Silva Garcia ', NULL, 0, 892, 892, 211, '0', 0),
(1343, 946, 0, 0, 'DJ Alyosha Barreiro', '0', 1319587200, 1319587200, NULL, '10:30 pm', 'Pasó su infancia explorando los sonidos de las cacerolas, las tazas y otros motivos de tipo casero…luego se hizo evidente su intuición musical, y desde entonces se ha preocupado por formalizar su educación. Alyosha Barreiro –productor, compositor y DJ—actuará este 26 de octubre en la fiesta alternativa de música electrónica que organiza la Dirección General de Arte y Cultura.', 1319587200, 'Polideportivo de la villa', 'Polideportivo de la villa', NULL, 0, 892, 892, 212, '0', 0),
(1344, 946, 0, 0, 'prueba', '590', 1319587200, 1319587200, NULL, '12:00 pm', 'prueba', 1319587200, 'prueba', 'prueba', NULL, 0, 892, 892, 213, '0', 0),
(1346, 946, 0, 0, ' Ensamble Vocal de la Universidad de Colima ', '0', 1319587200, 1319673600, NULL, '10:00 pm', 'El día de hoy en la Pinacoteca Universitaria Alfonso Michel,  se presentará el Ensamble Vocal de la Universidad de Colima en punto de las 20:30 horas, como parte del programa permanente Sonidos del Vitral.\nEs bajo la dirección del Mtro. Jaime Ignacio Quintero Corona, que dicho grupo presentará un repertorio compuesto con piezas como: morena me llaman; el cañaveral; un mundo raro; quisiera; las cuatro palomas, entre otras.', 1319587200, 'Pinacoteca Universitaria', 'Pinacoteca Universitaria', NULL, 0, 892, 892, 215, '0', 0),
(1347, 946, 0, 0, 'Manías en Celo: la infidelidad nunca fue tan divertida', '0', 1319587200, 1319760000, NULL, '10:30 pm', '¡La infidelidad nunca fue tan divertida!\n\nVisitan otros cuerpos y otros labios…pero pasan tantas cosas divertidas en el trayecto que parece que la infidelidad es la mejor medicina contra el aburrimiento. La Compañía Alarifes Teatro protagonizará una temporada de la obra “Manías en celo”. La cita es a las 20:30 horas en el Teatro Universitario. Entrada: 80 pesos, con 50% de descuento para estudiantes y Red Cultura Ucol. \nAlarifes Teatro es un grupo de reciente creación integrado por Cinthia Rangel, Monserrat Sánchez, Liz Michel, Lety García, César Solórzano, José Francisco Ventura y Octavio Juanarena, todos ellos universitarios quienes tienen en común, la pasión por contar historias en un escenario. Su experiencia por separado abarca monólogos, dramas y teatro musical. Manías en celo representa su primera producción como grupo.', 1319587200, 'Teatro Universitario', 'Teatro Universitario', NULL, 0, 892, 892, 216, '0', 0),
(1348, 946, 0, 0, 'Leo... luego existo con XAVIER MARC', '0', 1319587200, 1319760000, NULL, '10:00 pm', 'Actor invitado XAVIER MARC\n\nHa ganado tres premios como mejor actor de teatro, un premio de revelación en Francia por la película “El Rapaz”, una nominación al Emmy de la TV. Americana (EU.). \n\nHa Filmado 7 películas en Francia y otras tantas en Estados Unidos.\n\nHa participado en muchas telenovelas, alrededor de 40, siendo las principales, “Barrera de Amor”, “Amarte es mi Pecado”,  “María Belén”, “El niño que vino del mar”, “La Fiera”, “La Venganza”, “El hogar que yo robe” y la última que fue “Juro que te amo”, donde interpretó  padre Basilio.', 1319587200, 'Centro de Tecnología Educativa, Tecomán, Colima', 'Centro de Tecnología Educativa, Tecomán, Colima', NULL, 0, 892, 892, 217, '0', 0),
(1362, 946, 0, 0, 'Univerdanza', '0', 1319673600, 1319760000, NULL, '9:30 pm', 'No conciben la vida sin imaginar, sin movimiento. Los univerdanzantes ponen todos sus huesos y todas sus articulaciones al servicio de la danza, la cita es en la Pinacoteca Universitaria a las 20:30 horas. ', 1319673600, 'Pinacoteca Universitaria', 'Pinacoteca Universitaria', NULL, 0, 892, 892, 225, '0', 0),
(1368, 946, 0, 0, 'Leo... luego existo, Colima: Juan Diego Gaytán', '0', 1319673600, 1320710400, NULL, '7:30 pm', 'Juan Diego Gaytán Rodríguez, coordinador general de extensión universitaria, se sumará al programa “Leo…luego existo Colima” por segunda ocación la cita es a las 18:00 horas en  el Centro de tecnología, Manzanillo, Col. Entrada libre.\n“A veces minimizamos o incluso satanizamos las historietas porque consideramos que no abonan al ejercicio de la lectura y, aunque parezca mentira, éstas pueden servir como un puente que luego nos acerque a obras más profundas y complejas”, nos compartió Gaytán Rodríguez, quien cree en el proceso evolutivo de los lectores', 1319673600, 'Centro de tecnología, Manzanillo, Col. /18:00 horas.', 'Centro de tecnología, Manzanillo, Col. /18:00 horas.', NULL, 0, 892, 892, 230, '0', 0),
(1370, 946, 0, 0, 'Danza Arte Joven Iaorana', '0', 1319673600, 1321401600, NULL, '7:00 pm', 'Dentro del programa Foro Danza Arte Jóven, se presentará el grupo de danza polinesia Iaorana, agrupación que dará muestra de su talento los miércoles 9 y 16 de noviembre de 2011, en el Foro Pablo Silva García en punto de las 17:00 horas. La cuota de recuperación será de 40 pesos, la Red Cultura UCOL podrá copntar con descuento del 50 por ciento.', 1319673600, 'Foro Pablo Silva García / 17:00 horas ', 'Foro Pablo Silva García / 17:00 horas ', NULL, 0, 892, 892, 231, '0', 0),
