(1484, 946, 0, 0, 'Ensayo abierto con la Banda Sinfónica de la Universidad de Colima', '0', 1320019200, 1318550400, NULL, '12:00 pm', 'La Banda Sinfónica ofrece el ensayo abierto, como parte del programa de Apreciación Artística. Un ensayo se interrumpe continuamente para hacer correcciones, o dar sugerencias o indicaciones que perfeccionen la obra que está en proceso de gestación. Se presentan a los asistentes los instrumentos musicales que integran la orquesta: barítono, tarola, bombo, timbales, percusiones y otros instrumentos que, al tocar la nota precisa en el momento preciso, hacen emerger piezas musicales.', 1320019200, 'Foro Pablo Silva García', 'Foro Pablo Silva García', NULL, 0, 892, 892, 288, '0', 0),
