(1490, 946, 0, 0, 'Bellas Artes a todas partes presenta:  Desazón', '669', 1320019200, 1321488000, NULL, '9:30 pm', 'Desazón es una obra de Víctor Hugo Rascón Banda en la que tres mujeres hablan y cocinan recuerdos. Unidos los ingredientes esos sabores tan chihuahuenses, a la vida de estas tres sobrevivientes de la soledad, la marginación, el arrojo y la convicción, María Müller, menonita, Consuelo Armenta, mujer de la sierra de Chihuahua y Amanda Campos, vestida con ropa tarahumara, comparten lo que ha sido su vida en una tierra donde las fronteras de la religión, el idioma, el narcotráfico y la guerrilla.\n\n ', 1320019200, 'Teatro Universitario/ 20:30 horas', 'Teatro Universitario/ 20:30 horas', NULL, 0, 892, 892, 294, '0', 0),
(1492, 946, 0, 0, '“La Noche de la Bombilla Verde”', '673', 1320019200, 1321574400, NULL, '10:00 pm', ' “La Noche de la Bombilla Verde”  La Casa de la Bombilla Verde y el Foro de la Media Luna, espacios creados bajo el auspicio del baúl de los Títeres de Cachiporra y Los Fantoches de Comala, de Toño Velasco, hoy, “Los Títeres de la Media Luna” enmarcados, en una aparente informalidad temática musical:  Canto Nuevo, Trova, Música Folclórica,  Danza, Títeres, Poesía, Literatura y Galería; además de los ya clásicos Palomazos espontáneos de la noche y que estarán abiertos, convocando a todo el público, amante o no, de estas expresiones artísticas culturales sin ningún protocolo o formalidad.\n\n ', 1320019200, 'Explanada central de la ex Hacienda de Nogueras, en Comala  20:00 horas', 'Explanada central de la ex Hacienda de Nogueras, en Comala  20:00 horas', NULL, 0, 892, 892, 296, '0', 0),
