(1495, 946, 0, 0, 'Confluencias: Pantomimas del Yo', '689', 1320019200, 1322006400, NULL, '10:30 pm', 'Teatro del cuerpo, pintura y textos, es un espectáculo multidisciplinario en el que interactúan diversas manifestaciones artísticas para crear una atmósfera diferente a lo visto.', 1320019200, 'Pinacoteca Universitaria', 'Pinacoteca Universitaria', NULL, 0, 892, 892, 299, '0', 0),
(1497, 946, 0, 0, 'Concierto de Rock con After Eight', '708', 1320019200, 1322092800, NULL, '9:30 pm', 'El grupo After Eight de la Universidad de Colima ofrecerá concierto de rock.\n\nIntegrantes: Damian Artrus (voice), Alan Esparza (drums), Sergio Cervantes (guitar) y Rogelio Domínguez (keyboard).\n\nCon música de las reconocidas bandas como: The Doors, Red Hot Chilli Peppers, Guns & Roses, Maroon 5 y Caifanes.', 1320019200, 'Foro Pablo Silva García 20:30 horas', 'Foro Pablo Silva García 20:30 horas', NULL, 0, 892, 892, 301, '0', 0),
(1498, 946, 0, 0, 'Johnny English Recargado', '716', 1320019200, 1320451200, NULL, '12:00 pm', 'Rowan Atkinson vuelve a encarnar al espía accidental, siempre ajeno al miedo y al peligro, en la comedia de espías JOHNNY ENGLISH REBORN. En esta nueva entrega, el espía más insólito del servicio secreto de Su Majestad deberá detener a un grupo de asesinos internacionales antes de que eliminen a un líder mundial y abran la puerta al caos global.', 1320019200, 'Cinépolis Zentralia', 'Cinépolis Zentralia', NULL, 0, 892, 892, 302, '0', 0),
