(1884, 946, 0, 0, 'Charlando sobre la impostación de la voz', '903', 1321315200, 1322524800, NULL, '11:30 am', 'Se valen de su voz –de sus graves perfectos, de las notas impecables—para erizar la piel de los espectadores. El maestro Mario Cortés impartirá el taller “Charlando sobre la impostación de la voz” en sesiones de trabajo que tendrán lugar los días 8, 15, 22 y 29 de noviembre, en punto de las 10:00 de la mañana, en el Foro Pablo Silva García. El taller se suscribe al Programa de Apreciación Artística que organiza la Dirección General de Arte y Cultura.', 1321315200, 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre 10:00 horas', 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre 10:00 horas', NULL, 0, 892, 892, 454, '0', 0),
(1886, 946, 0, 0, 'Sonidos del Vitral: Coro de Niños Cantores', '906', 1321315200, 1321488000, NULL, '10:30 pm', 'Gabriel Frausto Zamora, director de los Niños Cantores de la Universidad de Colima, lleva al séquito de niños al escenario de Sonidos del Vitral: se presentan el 17 de noviembre a las 20:30 horas en la Pinacpteca Universitaria. Aunque niños, los integrantes del coro ya conocen a cabalidad el significado de la palabra “disciplina”.', 1321315200, 'Pinacoteca Universitaria 17 de noviembre 20:30 horas', 'Pinacoteca Universitaria 17 de noviembre 20:30 horas', NULL, 0, 892, 892, 456, '0', 0),
(1887, 946, 0, 0, 'Temporada: Cuatro Milpas Teatro', '912', 1321315200, 1321660800, NULL, '10:00 pm', 'Anubis: Christian Rangel permite que exploremos sus convicciones, sus creencias; el actor –integrante de la Compañía Cuatro Milpas Teatro—presenta el monólogo Anubis, con funciones el 18 y 19 de noviembre a las 20:00 horas en la Sala Emilio Carballido, ubicada en el edificio de talleres de Casa de la Cultura.\nChristian –que en ese entonces ya no será Christian sino su personaje Anubis—aparece en el escenario acompañado, por momentos, de un objeto inanimado: un maniquí que lo escolta en buena parte de la historia…luego, con ayuda de proyecciones y otros recursos audiovisuales, el personaje –enfundado en pantalones blancos y con el pecho desnudo—empieza a verter sus idea en torno a la fe, la religión…la experiencia de escribir y protagonizar este espectáculo ha sido liberadora para el actor colimense.', 1321315200, 'Sala Emilio Carballido, Casa de la Cultura de Colima 18 y 19 de noviembre/20:00 hrs.', 'Sala Emilio Carballido, Casa de la Cultura de Colima 18 y 19 de noviembre/20:00 hrs.', NULL, 0, 892, 892, 457, '0', 0),
