(1893, 946, 0, 0, 'Leo... luego existo con Emilia Carranza', '927', 1321315200, 1322179200, NULL, '9:30 pm', 'Actriz invitada Emilia Carranza\nInicio su carrera como actriz en 1958 con una actuacion en la pelicula mexicana Pepito y los robachicos. Más tarde participo en el filme Los hijos del divorcio. Tiene una gran trayectoria en el mundo de las telenovelas, algunos melodramas en los que ha actuado, son: Sor Juana Ines de la Cruz (1962), Encadenada (1962), La gata (1970), El maleficio (1983), Maria la del barrio (1995), El niño que vino del mar (1999), El precio de tu amor (2000), Niña amada mia (2003) y Barrera de amor (2005), entre otras. Algunas de las peliculas en las que ha actuado, son: Santo vs. las lobas (1976), El profugo (1992) y La vibora (1995), por mencionar algunas. Entre 1995 y 2006, ha grabado más de diez episodios de la serie dramatica, Mujer, casos de la vida real. En 2008, se integra al elenco de la serie Central de abasto, con el personaje de "Gabriela"', 1321315200, 'Pinacoteca Universitaria 25 de noviembre de 2011', 'Pinacoteca Universitaria 25 de noviembre de 2011', NULL, 0, 892, 892, 463, '0', 0),
(1896, 946, 0, 0, 'Yogooooo bailandooo!!!', '936', 1321315200, 1321315200, NULL, '12:00 pm', 'Clases abiertas de baile en el tubo y en la mesa para todo tipo de eventos, impartidas por el bailarín profesional Yogo Yoguin Yogon. No falten se les pondrá una asistencia de 5 horas. La entrada es libre', 1321315200, 'En las mejores instalaciones donde exista un tubo y una mesa!', 'En las mejores instalaciones donde exista un tubo y una mesa!', NULL, 0, 892, 892, 466, '0', 0),
(1898, 946, 0, 0, 'Taller: Fotografía digital avanzada', '946', 1321315200, 1323302400, NULL, '9:30 pm', '15, 17, 22, 24 y 29 de noviembre\n1, 6 y 8 de diciembre\nAlejandro González, nos invita a participar del alucinante mundo de la fotografía digital en donde se explorarán los conceptos básicos sobre los diferentes modos de la captura digital y que aspectos son los más importantes a tener en cuenta a la hora de pensar en tomar una fotografía que se convertirá en una obra de arte.', 1321315200, 'Museo Universitario de Artes Populares "María Teresa Pomar"', 'Museo Universitario de Artes Populares "María Teresa Pomar"', NULL, 0, 892, 892, 467, '0', 0),
(1899, 946, 0, 0, 'Leo…luego existo, Miguel León Govea', '951', 1321315200, 1322524800, NULL, '11:30 am', 'Miguel León Govea, Nació en 1985 en Colima, México, el cree que definitivamente Colima es un lugar muy tranquilo para nacer. Es egresado de la carrera de Letras Hispanoamericanas en la U de C, y actualmente se dedica a la corrección de estilo. Desde hace algunos años se ha concentrado en la creación literaria, especialmente en la poesía.\n\n ', 1321315200, 'Bachillerato 22, Quesería, Colima 29 de noviembre  10:00 horas', 'Bachillerato 22, Quesería, Colima 29 de noviembre  10:00 horas', NULL, 0, 892, 892, 468, '0', 0),
(1900, 946, 0, 0, 'Bahía 70. Los Beebys en concierto', '962', 1321315200, 1322870400, NULL, '10:00 pm', 'Con un repertorio compuesto principalmente de canciones clásicas como Have you ever seen the rain de Creedence; Clear water revival, House of the rising sun de The Animals; Satisfaction de los Rolling Stone; magical mistery tour de los Beatles, entre otras. la agrupación musical Los Beebys, se presentará el próximo 3 de diciembre en el Teatro Universitario Cnel. Pedro Torres Ortiz, en punto de las 20:30 hrs.', 1321315200, 'Teatro Universitario 3 de diciembre de 2011 /20:30 horas', 'Teatro Universitario 3 de diciembre de 2011 /20:30 horas', NULL, 0, 892, 892, 469, '0', 0),
(1901, 946, 0, 0, 'XVI Taller Práctico de Narrativa ROBERTO VILLA', '981', 1321315200, 1298937600, NULL, '9:30 pm', 'Todos los lunes , a partir del 14 de noviembre y hasta el mes de marzo. \nDe 19:00 a 21:30 horas\nROBERTO VILLA insiste en formar a los mejores lectores y escritores de la región. El taller tendrá sesiones de trabajo los lunes, a partir del 14 de noviembre y hasta el mes de marzo. Desde las 19:00 a 21:30 horas, en instalaciones de la radiodifusora UNIVERSO FM, ubicada en campus central de la Casa de Estudios.\n\nEn doce sesiones de trabajo, los integrantes del taller –que, como único requisito, deben ser lectores empedernidos — afinarán algunas de sus habilidades para narrar, para contar historias; explorarán todas las posibilidades que existen para contar algo. Es importante que para la primera sesión quienes se inscriban lleven un texto que no exceda de tres cuartillas.\n\nROBERTO VILLA (Guadalajara, Jalisco), es un escritor de calidad probada: autor de siete novelas, entre ellas una inédita que lleva como título In crescendo, y ganador del Premio Internacional Palma de Oro, que se otorga a los mejores cuentistas. \n\nEl XVI Taller Práctico de Narrativa tiene un costo de 400 pesos mensuales y 200 pesos mensuales para estudiantes de la Universidad de Colima. Los interesados pueden inscribirse en la dirección electrónica: culturales@ucol.mx. Cupo limitado.\n\nOrganizan El Comentario, la Dirección General de Publicaciones y la Dirección General de Arte y Cultura de la Universidad de Colima.\n\n ', 1321315200, 'Sala de usos múltiples  radiodifusora UNIVERSO FM, ubicada en campus central de la Casa de Estudios.', 'Sala de usos múltiples  radiodifusora UNIVERSO FM, ubicada en campus central de la Casa de Estudios.', NULL, 0, 892, 892, 470, '0', 0),
