(2030, 822, 0, 0, 'Exposición Rostros de la divinidad.', '1239', 1321574400, 1322611200, NULL, '5:00 pm', 'Los mosaicos mayas de piedra verde inauguran salas temporales de Museo de Arqueología de Occidente.\nEscénicas Horario: martes a domingo, de 10:00 a 17:00 horas ', 1321574400, 'Museo de Arqueología de Occidente en Zaragoza 224, entre San Felipe y Reforma', 'Museo de Arqueología de Occidente en Zaragoza 224, entre San Felipe y Reforma', NULL, 0, 796, 796, 520, '0', 0),
(2031, 822, 0, 0, 'Proyección de la Película "Superman" The Movie', '1248', 1321574400, 1322524800, NULL, '5:00 pm', 'DIRIGIDA POR RICHARD DONNER\nEscénicas Información adicional y descuentos: ENTRADA LIBRE ', 1321574400, 'SALA GUILLERMO DEL TORO INSTITUTO CULTURAL CABAÑAS ', 'SALA GUILLERMO DEL TORO INSTITUTO CULTURAL CABAÑAS ', NULL, 0, 796, 796, 521, '0', 0),
(2090, 946, 0, 0, 'Charlando sobre la impostación de la voz', '1330', 1321920000, 1322524800, NULL, '12:00 pm', 'Se valen de su voz –de sus graves perfectos, de las notas impecables—para erizar la piel de los espectadores. El maestro Mario Cortés impartirá el taller “Charlando sobre la impostación de la voz” en sesiones de trabajo que tendrán lugar los días 8, 15, 22 y 29 de noviembre, en punto de las 10:00 de la mañana, en el Foro Pablo Silva García. El taller se suscribe al Programa de Apreciación Artística que organiza la Dirección General de Arte y Cultura.', 1321920000, 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre', 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre', NULL, 0, 892, 892, 537, '0', 0),
(2091, 946, 0, 0, 'Foro Danza Arte Joven: Univerdanza', '1334', 1321920000, 1321920000, NULL, '10:00 pm', 'Guiados por el sonido de diversos ritmos como la opera, secondas, clásico jazz, entre otros; y utilizando el cuerpo como medio de expresión, sus integrantes, exponen diversas técnicas de entrenamiento, que derivan de la danza contemporánea.', 1321920000, 'Foro Pablo Silva García  17:00 horas ', 'Foro Pablo Silva García  17:00 horas ', NULL, 0, 892, 892, 539, '0', 0),
(2092, 946, 0, 0, 'Sonidos del Vitral: Gala de ópera', '1338', 1321920000, 1321920000, NULL, '10:00 pm', 'SCHUMANN y BRAHMS\nMaestros y alumnos del departamento de música del IUBA\nSchumann es el legítimo sucesor de Franz Schubert en el género del Lied (canción alemana). Gracias a él, este género alcanza un grado de perfección y una delicadeza de sentimientos insospechados.\n\nBrahms es reconocido unánimemente como uno de los compositores más importantes en lo que se refiere a la música de cámara, género en el que destacó desde su juventud. La sonata Op. 120 No.1 fue compuesta en 1894 para el clarinetista Richard Mühlfeld. Posteriormente Brahms mismo compuso los arreglos de esta sonata para viola, y violín. \nEste programa es presentado por los maestros del Departamento del Música de Instituto  Universitario de Bellas Artes: Luis Manuel Cernas, Oleksander Yanyev, Gleb Dobrushkin, y los alumnos de Licenciatura en Música (Canto) Karina Velázquez y Enrique Mejía Núñez (bajo la tutela de la Mtra. Marta Wilimowska).\n\n ', 1321920000, 'Pinacoteca universitaria 20:30 horas', 'Pinacoteca universitaria 20:30 horas', NULL, 0, 892, 892, 540, '0', 0),
(2094, 946, 0, 0, 'Fotojazz Exposición fotográfica de Gonzalo Vidal ', '1343', 1321920000, 1322265600, NULL, '8:30 pm', 'Gonzalo Vidal  nos deleitará con la Expo de jazz, es miembro del fondo Cubano de la Imagen Fotográfica, originario de Punta Arenas, Chile. Actualmente reside en La Habana, Cuba.  La cita es el 26 de noviembre a las 19:00 horas. ', 1321920000, 'Pinacoteca Universitaria  19:00 horas Entrada libre', 'Pinacoteca Universitaria  19:00 horas Entrada libre', NULL, 0, 892, 892, 541, '0', 0),
(2095, 946, 0, 0, 'Ballet Folklórico de la Universidad de Colima  y Ballet Folklórico Infantil Los Niños de Colima', '1348', 1321920000, 1321920000, NULL, '11:00 pm', 'El Ballet Folklórico de la Universidad de Colima, con un concepto renovado de la danza folklórica, muestra la cultura popular distintiva de la república mexicana. Las danzas de nuestras primeras civilizaciones y de los contemporáneos son reflejadas en programas distinguidos por excelente técnica, dominio escénico y el ingenio de su creador el Mtro. Rafael Zamarripa Castañeda. El Ballet Folclórico Infantil Los niños de Colima, obtuvo el Premio a la Excelencia, máximo reconocimiento que otorga el Youth Dance Festival of New Jersey que se celebró los días 8 y 9 de octubre en Estados Unidos.', 1321920000, 'Teatro Universitario 20:30 horas Función a beneficio de la Cruz Roja Mexicana', 'Teatro Universitario 20:30 horas Función a beneficio de la Cruz Roja Mexicana', NULL, 0, 892, 892, 542, '0', 0),
