(2107, 822, 0, 0, 'El Libro Mágico ', '1358', 1322006400, 1324166400, NULL, '12:00 pm', 'Un  par de hermanos  encuentran un libro  mágico que los lleva a vivir  grandes aventuras en los libros  clásicos de todos los tiempos, motivando a los niños de leer y el gusto por la lectura.\nLas funciones son los días 27 de noviembre y 04, 11 y 18 de diciembre del 2011\n\n', 1322006400, 'Teatro Alarife Martin Casillas', 'Teatro Alarife Martin Casillas', NULL, 0, 796, 796, 549, '0', 0),
(2108, 822, 0, 0, 'Curso Residuos para recolectores', '1364', 1322006400, 1322956800, NULL, '9:00 am', 'Desmiente SEMADES que se este obligando a los recolectores de residuos de manejo especial a tomar el "Diplomado en Manejo de Residuos Sólidos" a impartirse por ORIENTA\nCurso Residuos para recolectores\nEscénicas Del: 30-nov-2011\nAl: 04-dic-2011\n\n ', 1322006400, 'Orienta', 'Orienta', NULL, 0, 796, 796, 550, '0', 0),
(2109, 822, 0, 0, 'Encuentro de la Muerte', '1371', 1322006400, 1322438400, NULL, '8:30 pm', 'Del: 26-nov-2011\nAl: 28-nov-2011  Horario: Sábado y Lunes 20:30 horas Domingo 18:00 horas\nInformación adicional y descuentos: Costo para estudiantes, maestros y personas de la tercera edad es de $60 pesos \n ', 1322006400, 'Patio del Exconvento del Carmen', 'Patio del Exconvento del Carmen', NULL, 0, 796, 796, 551, '0', 0),
(2111, 822, 0, 0, 'CUICO', '1379', 1322006400, 1322438400, NULL, '8:30 pm', 'Ramón trabaja como policía, profesión que ha terminado por desdibujar su identidad, supliéndola con uno de los roles sociales más peligrosos y odiados. El "Cuico" un vocablo genuinamente tapatío, comúnmente asociado a connotaciones peyorativas, se encarna en un personaje ambivalente que lucha por salir adelante pese a una historia de vida miserable.', 1322006400, 'Sala Higinio Ruvalcaba del Ex Convento del Carmen ', 'Sala Higinio Ruvalcaba del Ex Convento del Carmen ', NULL, 0, 796, 796, 552, '0', 0),
(2115, 822, 0, 0, 'Las Sombras de Beckett', '1398', 1322006400, 1322956800, NULL, '8:00 pm', 'Una nueva experiencia escénica  en la que los espectadores son privados de la vista, para que así tengan "alerta" sus sentidos  durante la obra de teatro, esta puesta en escena está bajo la técnica del "Teatro Ciego"\nDel: 26-nov-2011\nAl: 04-dic-2011  Horario: 20:00 horas (sábado) 18:00 horas (domingo)', 1322006400, 'Teatro Alarife Martín Casillas', 'Teatro Alarife Martín Casillas', NULL, 0, 796, 796, 554, '0', 0),
(2162, 822, 0, 0, 'Feria Internacional del Libro 2011', '1485', 1322179200, 1322956800, NULL, '9:00 pm', 'Feria Internacional del Libro 2011\n\nInvitado de Honor Alemania', 1322179200, 'Expo Guadalajara', 'Expo Guadalajara', NULL, 0, 796, 796, 573, '0', 0),
(2201, 822, 0, 0, 'Concierto para película silente: Faust y Dr. Fanatik ', '0', 1322438400, 1322438400, NULL, '9:00 pm', 'La película clásica del cine silente Faust, del año 1926, trata la antigua temática de Fausto, la cual ya había dado fama mundial a Johann Wolfgang von Goethe: el pacto entre el arcángel Miguel y Mefistófeles y el amor entre Fausto y Gretchen. El director de cine Friedrich Wilhelm Murnau generó este clásico de la historia del cine en la cima de su carrera profesional', 1322438400, 'Expo Guadalajara ', 'Expo Guadalajara ', NULL, 0, 796, 796, 587, '0', 0),
(2202, 822, 0, 0, 'El Cine en el Rojo', '0', 1322438400, 1322438400, NULL, '6:30 pm', 'Hasta el Viento tiene Miedo (Carlos Enrique Taboada).', 1322438400, 'Rojo Café 	José Guadalupe Zuno # 2027', 'Rojo Café 	José Guadalupe Zuno # 2027', NULL, 0, 796, 796, 588, '0', 0),
(2203, 822, 0, 0, 'Noche de Gala con Herta Müller (Premio Nobel 2009)', '0', 1322438400, 1322438400, NULL, '9:00 pm', 'En el marco de la FIL 2011 (invitado Alemania), la ganadora del Nobel acompañada por el actor mexicano Arturo Ríos, dará vida a fragmentos de Todo lo que tengo lo llevo conmigo, una de sus obras más emblemáticas.Una Lectura en compañia de Arturo Ríos.', 1322438400, 'Teatro Diana ', 'Teatro Diana ', NULL, 0, 796, 796, 589, '0', 0),
(2204, 822, 0, 0, 'XXXV Feria Nacional del Tequila', '1575', 1322438400, 1323648000, NULL, '6:00 pm', 'Desfile Inaugural: 26 de noviembre 16:00 hrs. Feria: Todo los días a partir de 19:00 hrs.\nFecha:26 de noviembre al 12 de diciembre 2011.\nVive la mágia de esta tierra.\nLa Feria Nacional de Tequila, que por segunda ocasión consecutiva este año se encuentra ubicada en la unidad deportiva Francisco Javier Sauza Mora al ingreso de la población, se realiza cada último sábado del mes de noviembre hasta el segundo domingo del mes de diciembre, uniéndose esta festividad a la celebración patronal de de la Virgen de Guadalupe y de la Inmaculada Concepción, con cohetes y fuegos artificiales, repique de campanas y procesiones de los barrios a la parroquia, música y carros alegóricos.', 1322438400, 'Unidad Deportiva Francisco Javier Sauza Mora (Frente a la Gasolinera al ingreso principal) ', 'Unidad Deportiva Francisco Javier Sauza Mora (Frente a la Gasolinera al ingreso principal) ', NULL, 0, 796, 796, 590, '0', 0),
(2205, 822, 0, 0, 'Proyección de la película "X Men"', '1581', 1322438400, 1323129600, NULL, '5:00 pm', 'En un futuro cercano, la humanidad comienza a ver aparecer una nueva raza; los mutantes. Dotados de extraños y variados poderes, están agrupados en dos bandos: los que abogan por la integración y el entendimiento con la humanidad, encabezados por el doctor Charles Xavier, y los que buscan el enfrentamiento con una raza que consideran inferior y que les odia, dirigidos por Magnus, alias Magneto, un peligroso mutante con extraordinarios poderes', 1322438400, 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', NULL, 0, 796, 796, 591, '0', 0),
(2206, 822, 0, 0, 'Proyección de video: Traducción ySíntesis', '1587', 1322438400, 1323129600, NULL, '6:00 pm', 'La traducción es un recurso creativo muy vasto en sus resultados y su origen lo podemos advertir en la habilidad de sinestesia que poseen o desarrollan algunas personas. Carlos Amorales y Erick Beltrán abordan la riqueza de este recurso en su sistema de producción y el interés que en la estética adquiere. Bruno Estañol habla desde el mundo de la neurología de dicho concepto y de las distintas formas de experiencia que conlleva.\n\n ', 1322438400, 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', NULL, 0, 796, 796, 592, '0', 0),
(2207, 822, 0, 0, 'Proyección de la Película "Batman"', '1594', 1322438400, 1323734400, NULL, '5:00 pm', 'Taquillera cinta basada en el héroe de cómic. La oscura y peligrosa ciudad de Gotham tan sólo se halla protegida por su corrupto cuerpo de policía. A pesar de los esfuerzos del fiscal del distrito Harvey Dent y el comisionado de policía Jim Gordon, la ciudad es cada vez más insegura hasta que aparece Batman, el Señor de la Noche. La reputada jornalista Vicky Vale intentará descubrir el secreto que se oculta tras la capa del hombre murciélago. ', 1322438400, 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', NULL, 0, 796, 796, 593, '0', 0),
(2208, 822, 0, 0, 'Encuentro Metropolitano de Orquestas Infantiles', '1603', 1322438400, 1322697600, NULL, '8:00 pm', 'Encuentro Metropolitano de Orquestas Infantiles\nEscénicas', 1322438400, 'Teatro Degollado', 'Teatro Degollado', NULL, 0, 796, 796, 594, '0', 0),
