(2211, 822, 0, 0, 'Proyección de video: Entre Líneas', '1638', 1322438400, 1323734400, NULL, '6:00 pm', 'El concepto de obra abierta es uno de los principales ejes que articulan en el arte contemporáneo; parte de su complejidad es advertir el discurso que subyace en una diversidad de líneas de investigación y procesos productivos. Jonathan Hernández y Enrique Jezik hablan de la manera que construyen sus repertorios visuales y cómo se distancian para enunciar algún asunto de su interés. Diego Lizarazo, experto en semiótica, habla de la imbriación entre lenguajes y códigos visuales y la manera en que se utilizan e interpretan por parte de los artistas y del público.', 1322438400, 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', NULL, 0, 796, 796, 597, '0', 0),
(2212, 822, 0, 0, 'Recital de piano a cargo de la maestra Patricia García Torres / Homenaje Franz Liszt', '1651', 1322438400, 1323129600, NULL, '8:30 pm', 'Anexo:/wps/wcm/connect/884ac900493057d7affaaf7a9e41262e/liszt.jpg?MOD=AJPERES&CACHEID=884ac900493057d7affaaf7a9e41262e\nInformación adicional y descuentos: Entrada Libre', 1322438400, 'Sala Higinio Ruvalcaba del Ex Convento del Carmen', 'Sala Higinio Ruvalcaba del Ex Convento del Carmen', NULL, 0, 796, 796, 598, '0', 0),
(2213, 822, 0, 0, 'Exposición "Observaciones" de Ricardo Cueriel', '1665', 1322438400, 1296345600, NULL, '9:00 pm', '09-dic-2011\nAl: 30-ene-2012\nRicardo Cueriel ha presentado sus obras en diferentes exposiciones colectivas en México y España. De sus exposiciones individuales destacan: Cartografías, en el Museo Gene Byron de Guanajuato y Museo Casa Natal de Morelos en Morelia; micro existencias en el 35° Festival Internacional Cervantino y Continuidad en el Museo Casa Diego Rivera en Guanajuato.\n\n ', 1322438400, 'Ex Convento del Carmen ', 'Ex Convento del Carmen ', NULL, 0, 796, 796, 599, '0', 0),
(2214, 822, 0, 0, 'IV COLOQUIO INTERNACIONAL DE CULTURA CIENTÍFICA', '1680', 1322438400, 1322784000, NULL, '6:00 pm', 'El Consejo Estatal de Ciencia y Tecnología de Jalisco tiene el honor de invitar a toda la comunidad al IV COLOQUIO INTERNACIONAL DE CULTURA CIENTÍFICA dentro del marco de la fil 2011.\nEscénicas\nDel: 01-dic-2011\nAl: 02-dic-2011', 1322438400, 'EXPO GUADALAJARA', 'EXPO GUADALAJARA', NULL, 0, 796, 796, 600, '0', 0),
