(2234, 822, 0, 0, 'DRA y Na’rimbo', '0', 1322524800, 1322524800, NULL, '9:00 pm', 'Christopher Dell, quien ha sido galardonado con numerosos premios, es considerado uno de los primeros vibrafonistas a escala mundial y es el eje central del grupo DRA. Dell, el bajista Christian Ramond y el baterista Félix Astor ponen a prueba los límites de lo rítmicamente posible, en una novedosa experiencia auditiva de carácter muy especial.', 1322524800, 'Expo Guadalajara ', 'Expo Guadalajara ', NULL, 0, 796, 796, 613, '0', 0),
