(2236, 822, 0, 0, 'Convocatoria para el desarrollo de "Planes de Acción Climática Municipal (PACMUN)', '1738', 1322524800, 1322524800, NULL, '12:00 pm', 'Es un proyecto financiado por la Embajada Británica en México que está siendo lanzado en el país por ICLEI-Gobiernos Locales por la Sustentabilidad con el respaldo técnico e institucional del Instituto Nacional de Ecología (INE) de la Secretaría de Medio Ambiente y Recursos Naturales (SEMARNAT). \nDel: 11-nov-2011\nAl: 07-dic-2011\nPara mayor información respecto a esta convocatoria, escribe a iclei.mexico@iclei.org, visita www.iclei.org.mx, o comunícate al teléfono: (55)36408725 ', 1322524800, '', '', NULL, 0, 796, 796, 615, '0', 0),
