(2246, 822, 0, 0, 'Exposición "Morir sin darme cuenta"', '1788', 1322524800, 1322956800, NULL, '8:00 pm', 'Ramírez Casillas es originario de Tepehuaje de Morelos, Jalisco. \nAlgunas de las exposiciones individuales en las que ha participado han sido en la Semana Cultural 2001 y 2002, respectivamente, de la Secretaria de Vialidad y Transporte de Jalisco; Bodegones Mexicanos (2003, H. Ayuntamiento de Guadalajara); Calaveras Mexicanas (2006, Museo de Arte Popular de la Secretaria de Cultura Jalisco) y Los Colores de la muerte (2008, Patio del Ex Convento del Carmen)', 1322524800, 'Patio del Ex Convento del Carmen ', 'Patio del Ex Convento del Carmen ', NULL, 0, 796, 796, 624, '0', 0),
