(72, 796, '19', '111', 'Paseos en Calandria', 'Estos paseos van por las calles antiguas o por la zona comercial de Guadalajara.\nA principios del siglo XX aparecen estos coches de alquiler que son unas carretas con capota plegable arrastradas por un corcel; en aquella época se mandaron pintar de negro con las ruedas amarillas, por lo que la gente las conoce hasta hoy como Calandrias.', 'Afuera del Museo Regional (Liceo, entre Av. Hidalgo e Independencia).', 1318464000, NULL, NULL, 1325289600, '9:00 pm', 'statics/img_eventos/822/4243f068f795c191171849cb447dd88f.jpg', 0, 2, 'Costo $200 (de 1 a 5 personas)', 0, '0', NULL, 4, 1318464000, NULL, NULL),
(77, 796, '17', '106', 'Dinosaurios terribles visitantes del cretácico', 'Gran parte de esta exposición fue reunida por el ingeniero Solórzano, recolectada en el Occidente de nuestro país y en numerosa localidades de nuestro estado. En esta región se conocen al menos 29 sitios que abarcan épocas de 136 millones de años, con una diversidad de, por lo menos 130 especies vegetales y animales. Entre los lugares fosolíferos de Jalisco se encuentran Colotlán, Teocaltiche, San', 'Museo de Paleontología de Guadalajara ', 1318464000, NULL, NULL, 1323907200, '6:30 pm', '0', 0, 2, 'Boleto $15 adultos o mayores de 12 años, $10 maestros y estudiantes con credencial, entrada libre para mayores de 60 años, discapacitados y menores de 12 años. Todos los martes entrada libre.\nHasta el Jueves 15 de diciembre Ma-S de 10:00 a 18:00 hrs. D de 11:00 a 16:00 hrs. Visitas guiadas 11:00, 12:30 y 16:30 hrs.', 0, '0', NULL, 4, 1318464000, NULL, NULL),
(112, 796, '17', '103', 'Mercadotecnia Patria: Los grandes festejos del Centenario 1910 	  Cerrar', 'El pasado 12 de septiembre se inauguró la exposición Mercadotecnia Patria: Los Grandes Festejos del Centenario 1910.\nLa muestra, que permanecerá abierta en este espacio hasta el 15 de enero de 2012, es una crónica visual que narra la historia de México y la conformación de su identidad permitiéndonos comprender distintas perspectivas y concepciones sobre la vida política, social y cultural de nues', 'Centro Cultural Casa Vallarta', 1318982400, 'normal', NULL, 1295049600, '6:00 pm', 'statics/img_eventos/822/81f752761e64f8e507b124b60a2882be.jpg', 0, 2, '', 0, '0', NULL, 4, 1318982400, NULL, NULL),
(189, 796, '17', '103', 'El sueño que canta la tierra', 'Fotografías de Enrique Carrasco sj. Entrada gratis con tu entrada al bosque.\nEn esta exposición se muestran 23 fotografías de Enrique Carrasco sj, sobre los “susurros” de la Madre Tierra, algunos de lamento y dolor, otros de alegría y esperanza. Así él nos da a conocer algunos aspectos de esta relación de amor y respeto de los pueblos indígenas con la Naturaleza, para que aprendamos de ellos y bus', 'Bosque Los Colomos, Las Pérgolas (Junto al Jardín Japonés) ', 1319500800, 'normal', NULL, 1323388800, '6:00 pm', 'statics/img_eventos/822/4f7477c03077bfc08b7a7708f254c1a8.JPG', 0, 2, '', 0, '0', NULL, 4, 1319500800, NULL, NULL),
(211, 892, '4', '11', 'Coral Divas de la Universidad de Colima', 'El grupo Voces femeninas está integrado por adolescentes es dirigido por la maestra Agustina Murguía. La cita es en el Foro Pablo Silva García el 5 y 26 de octubre a las 19:00 horas.\n\n', 'Foro Pablo Silva Garcia ', 1319587200, 'normal', NULL, 1319587200, '10:30 pm', '0', 0, 2, 'Cuota de recuperación es de 40 pesos, con un 50 por ciento de descuento para la Red Cultura UCOL', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(212, 892, '4', '6', 'DJ Alyosha Barreiro', 'Pasó su infancia explorando los sonidos de las cacerolas, las tazas y otros motivos de tipo casero…luego se hizo evidente su intuición musical, y desde entonces se ha preocupado por formalizar su educación. Alyosha Barreiro –productor, compositor y DJ—actuará este 26 de octubre en la fiesta alternativa de música electrónica que organiza la Dirección General de Arte y Cultura.', 'Polideportivo de la villa', 1319587200, 'normal', NULL, 1319587200, '10:30 pm', '0', 0, 2, ' El Polideportivo de Villa de Álvarez será sede del evento que se realizará en punto de las 19:00 horas. Entrada 60 pesos, con 50% para estudiantes y Red Cultura Ucol. Informes al 316 11 77.', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(213, 892, '21', '120', 'prueba', 'prueba', 'prueba', 1319587200, 'normal', NULL, 1319587200, '12:00 pm', 'statics/img_eventos/946/05901ff81d5fd6b2c5f397d2e8869e07.jpg', 0, 2, 'prueba', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(215, 892, '4', '11', ' Ensamble Vocal de la Universidad de Colima ', 'El día de hoy en la Pinacoteca Universitaria Alfonso Michel,  se presentará el Ensamble Vocal de la Universidad de Colima en punto de las 20:30 horas, como parte del programa permanente Sonidos del Vitral.\nEs bajo la dirección del Mtro. Jaime Ignacio Quintero Corona, que dicho grupo presentará un repertorio compuesto con piezas como: morena me llaman; el cañaveral; un mundo raro; quisiera; las cua', 'Pinacoteca Universitaria', 1319587200, 'normal', NULL, 1319673600, '10:00 pm', '0', 0, 2, 'La cuota de recuperación para esta presentación será de 60 pesos, la red cultura UCOL podrá obtener un 50 por ciento de descuento y así mismo acreditaran horas de actividades culturales.\nPara mayores informes puede comunicarse a la Dirección General de Arte y Cultura al teléfono 31-6-11-77.', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(216, 892, '18', '147', 'Manías en Celo: la infidelidad nunca fue tan divertida', '¡La infidelidad nunca fue tan divertida!\n\nVisitan otros cuerpos y otros labios…pero pasan tantas cosas divertidas en el trayecto que parece que la infidelidad es la mejor medicina contra el aburrimiento. La Compañía Alarifes Teatro protagonizará una temporada de la obra “Manías en celo”. La cita es a las 20:30 horas en el Teatro Universitario. Entrada: 80 pesos, con 50% de descuento para estudiant', 'Teatro Universitario', 1319587200, 'normal', NULL, 1319760000, '10:30 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(217, 892, '17', '103', 'Leo... luego existo con XAVIER MARC', 'Actor invitado XAVIER MARC\n\nHa ganado tres premios como mejor actor de teatro, un premio de revelación en Francia por la película “El Rapaz”, una nominación al Emmy de la TV. Americana (EU.). \n\nHa Filmado 7 películas en Francia y otras tantas en Estados Unidos.\n\nHa participado en muchas telenovelas, alrededor de 40, siendo las principales, “Barrera de Amor”, “Amarte es mi Pecado”,  “María Belén”, ', 'Centro de Tecnología Educativa, Tecomán, Colima', 1319587200, 'normal', NULL, 1319760000, '10:00 pm', '0', 0, 2, 'Entrada libre\nAcredita 3 horas Actividades culturales', 0, '0', NULL, 4, 1319587200, NULL, NULL),
(225, 892, '4', '20', 'Univerdanza', 'No conciben la vida sin imaginar, sin movimiento. Los univerdanzantes ponen todos sus huesos y todas sus articulaciones al servicio de la danza, la cita es en la Pinacoteca Universitaria a las 20:30 horas. ', 'Pinacoteca Universitaria', 1319673600, 'normal', NULL, 1319760000, '9:30 pm', '0', 0, 2, 'Costo: 60 pesos, con 50% para estudiantes y red cultura Ucol.\nAcredita 3 horas de actividades culturales', 0, '0', NULL, 4, 1319673600, NULL, NULL),
(230, 892, '17', '108', 'Leo... luego existo, Colima: Juan Diego Gaytán', 'Juan Diego Gaytán Rodríguez, coordinador general de extensión universitaria, se sumará al programa “Leo…luego existo Colima” por segunda ocación la cita es a las 18:00 horas en  el Centro de tecnología, Manzanillo, Col. Entrada libre.\n“A veces minimizamos o incluso satanizamos las historietas porque consideramos que no abonan al ejercicio de la lectura y, aunque parezca mentira, éstas pueden servi', 'Centro de tecnología, Manzanillo, Col. /18:00 horas.', 1319673600, 'normal', NULL, 1320710400, '7:30 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1319673600, NULL, NULL),
(231, 892, '4', '20', 'Danza Arte Joven Iaorana', 'Dentro del programa Foro Danza Arte Jóven, se presentará el grupo de danza polinesia Iaorana, agrupación que dará muestra de su talento los miércoles 9 y 16 de noviembre de 2011, en el Foro Pablo Silva García en punto de las 17:00 horas. La cuota de recuperación será de 40 pesos, la Red Cultura UCOL podrá copntar con descuento del 50 por ciento.', 'Foro Pablo Silva García / 17:00 horas ', 1319673600, 'normal', NULL, 1321401600, '7:00 pm', '0', 0, 2, ' La cuota de recuperación será de 40 pesos, la Red Cultura UCOL podrá copntar con descuento del 50 por ciento.', 0, '0', NULL, 4, 1319673600, NULL, NULL),
