(288, 892, '4', '11', 'Ensayo abierto con la Banda Sinfónica de la Universidad de Colima', 'La Banda Sinfónica ofrece el ensayo abierto, como parte del programa de Apreciación Artística. Un ensayo se interrumpe continuamente para hacer correcciones, o dar sugerencias o indicaciones que perfeccionen la obra que está en proceso de gestación. Se presentan a los asistentes los instrumentos musicales que integran la orquesta: barítono, tarola, bombo, timbales, percusiones y otros instrumentos', 'Foro Pablo Silva García', 1320019200, 'normal', NULL, 1318550400, '12:00 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1320019200, NULL, NULL),
