(292, 892, '4', '20', 'Clase abierta: Niños Cantores de la UdeC', 'Los Niños Cantores de la UdeC y su director Gabriel Frausto Zamora, abren sus puertas de ensayo para recibir a estudiantes universitarios a vivir una clase abierta con ellos, como parte del programa de Apreciación Artística.\n\n\n', 'Escuela de Música del IUBA', 1320019200, 'normal', NULL, 1321401600, '6:30 pm', 'statics/img_eventos/946/a88e3b1c30451a37ba9e4171cceed3e1.jpg', 0, 2, 'Los días 12 de octubre y 14 de diciembre, para estudiantes de bachillerato\n16 de noviembre, para estudiantes de Facultades\nLa entrada es libre y acredita 3 horas de actividades culturales', 0, '0', NULL, 4, 1320019200, NULL, NULL),
