(294, 892, '18', '147', 'Bellas Artes a todas partes presenta:  Desazón', 'Desazón es una obra de Víctor Hugo Rascón Banda en la que tres mujeres hablan y cocinan recuerdos. Unidos los ingredientes esos sabores tan chihuahuenses, a la vida de estas tres sobrevivientes de la soledad, la marginación, el arrojo y la convicción, María Müller, menonita, Consuelo Armenta, mujer de la sierra de Chihuahua y Amanda Campos, vestida con ropa tarahumara, comparten lo que ha sido su ', 'Teatro Universitario/ 20:30 horas', 1320019200, 'normal', NULL, 1321488000, '9:30 pm', 'statics/img_eventos/946/f220130a16937ecc745d267b42d29425.jpg', 0, 2, 'Entrada: 150 pesos, con 50% para red cultura Ucol.\nAcredita 5 horas de actividades culturales', 0, '0', NULL, 4, 1320019200, NULL, NULL),
(296, 892, '18', '147', '“La Noche de la Bombilla Verde”', ' “La Noche de la Bombilla Verde”  La Casa de la Bombilla Verde y el Foro de la Media Luna, espacios creados bajo el auspicio del baúl de los Títeres de Cachiporra y Los Fantoches de Comala, de Toño Velasco, hoy, “Los Títeres de la Media Luna” enmarcados, en una aparente informalidad temática musical:  Canto Nuevo, Trova, Música Folclórica,  Danza, Títeres, Poesía, Literatura y Galería; además de l', 'Explanada central de la ex Hacienda de Nogueras, en Comala  20:00 horas', 1320019200, 'normal', NULL, 1321574400, '10:00 pm', 'statics/img_eventos/946/0097f3c6bdb93cb2aee5a32771f78fe6.jpg', 0, 2, 'Entrada libre\nAcredita 2 horas de actividades culturales', 0, '0', NULL, 4, 1320019200, NULL, NULL),
