(299, 892, '18', '147', 'Confluencias: Pantomimas del Yo', 'Teatro del cuerpo, pintura y textos, es un espectáculo multidisciplinario en el que interactúan diversas manifestaciones artísticas para crear una atmósfera diferente a lo visto.', 'Pinacoteca Universitaria', 1320019200, 'normal', NULL, 1322006400, '10:30 pm', 'statics/img_eventos/946/df584328668f49652a8b74dad9a20521.jpg', 0, 2, 'La entrada para la  velada tendrá una cuota de recuperación de 60 pesos; la Red Cultura UCOL podrá contar con un 50 por ciento de descuento.', 0, '0', NULL, 4, 1320019200, NULL, NULL),
(301, 892, '4', '17', 'Concierto de Rock con After Eight', 'El grupo After Eight de la Universidad de Colima ofrecerá concierto de rock.\n\nIntegrantes: Damian Artrus (voice), Alan Esparza (drums), Sergio Cervantes (guitar) y Rogelio Domínguez (keyboard).\n\nCon música de las reconocidas bandas como: The Doors, Red Hot Chilli Peppers, Guns & Roses, Maroon 5 y Caifanes.', 'Foro Pablo Silva García 20:30 horas', 1320019200, 'normal', NULL, 1322092800, '9:30 pm', 'statics/img_eventos/946/58f929e97ccdb2dc76a55a3af4139865.jpg', 0, 2, 'La entrada para el concierto tendrá una cuota de recuperación de 60 pesos; la Red Cultura UCOL podrá contar con un 50 por ciento de descuento.', 0, '0', NULL, 4, 1320019200, NULL, NULL),
(302, 892, '18', '147', 'Johnny English Recargado', 'Rowan Atkinson vuelve a encarnar al espía accidental, siempre ajeno al miedo y al peligro, en la comedia de espías JOHNNY ENGLISH REBORN. En esta nueva entrega, el espía más insólito del servicio secreto de Su Majestad deberá detener a un grupo de asesinos internacionales antes de que eliminen a un líder mundial y abran la puerta al caos global.', 'Cinépolis Zentralia', 1320019200, 'normal', NULL, 1320451200, '12:00 pm', 'statics/img_eventos/946/e654acec862350569bd4d79f49577b61.jpg', 0, 2, '\n14:40ES 16:50ES 19:00ES 21:10ES', 0, '0', NULL, 4, 1320019200, NULL, NULL),
