(454, 892, '5', '31', 'Charlando sobre la impostación de la voz', 'Se valen de su voz –de sus graves perfectos, de las notas impecables—para erizar la piel de los espectadores. El maestro Mario Cortés impartirá el taller “Charlando sobre la impostación de la voz” en sesiones de trabajo que tendrán lugar los días 8, 15, 22 y 29 de noviembre, en punto de las 10:00 de la mañana, en el Foro Pablo Silva García. El taller se suscribe al Programa de Apreciación Artístic', 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre 10:00 horas', 1321315200, 'normal', NULL, 1322524800, '11:30 am', 'statics/img_eventos/946/639c008ff828a760889ebbcfb42371e2.jpg', 0, 2, '', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(456, 892, '24', '148', 'Sonidos del Vitral: Coro de Niños Cantores', 'Gabriel Frausto Zamora, director de los Niños Cantores de la Universidad de Colima, lleva al séquito de niños al escenario de Sonidos del Vitral: se presentan el 17 de noviembre a las 20:30 horas en la Pinacpteca Universitaria. Aunque niños, los integrantes del coro ya conocen a cabalidad el significado de la palabra “disciplina”.', 'Pinacoteca Universitaria 17 de noviembre 20:30 horas', 1321315200, 'normal', NULL, 1321488000, '10:30 pm', 'statics/img_eventos/946/55a10f4273a42b61c3f5fdc79a5d34ee.jpg', 0, 2, '', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(457, 892, '18', '147', 'Temporada: Cuatro Milpas Teatro', 'Anubis: Christian Rangel permite que exploremos sus convicciones, sus creencias; el actor –integrante de la Compañía Cuatro Milpas Teatro—presenta el monólogo Anubis, con funciones el 18 y 19 de noviembre a las 20:00 horas en la Sala Emilio Carballido, ubicada en el edificio de talleres de Casa de la Cultura.\nChristian –que en ese entonces ya no será Christian sino su personaje Anubis—aparece en e', 'Sala Emilio Carballido, Casa de la Cultura de Colima 18 y 19 de noviembre/20:00 hrs.', 1321315200, 'normal', NULL, 1321660800, '10:00 pm', 'statics/img_eventos/946/d8633c1b81e7d6c273586a5dd85f67cb.jpg', 0, 2, ' Entrada: 40 pesos, con 50% de descuento para estudiantes y Red Cultura Ucol.\n', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(459, 892, '24', '148', 'Temporada: Cuatro Milpas Teatro', 'Las citas de mi General: Es hora de conocer a detalle la vida y obra de unos de los caudillos más importantes de la Revolución Mexicana: Pancho Villa. Cuatro Milpas presenta la puesta en escena “Las citas de mi general”. ', 'Teatro Universitario 24 y 25 noviembre /19:30 hrs.', 1321315200, 'normal', NULL, 1322179200, '9:00 pm', 'statics/img_eventos/946/ac6a3bcb62e1d76a35a767c2a2a23f76.jpg', 0, 2, ' Teatro Universitario. 24 y 25 de noviembre. 7:30 de la tarde. Entrada: 60 pesos, con descuentos para estudiantes y red cultura.\n\nOrganiza Dirección General de Arte y Cultura de la Universidad de Colima. Informes al 3161177. ', 0, '0', NULL, 4, 1321315200, NULL, NULL),
