(463, 892, '4', '20', 'Leo... luego existo con Emilia Carranza', 'Actriz invitada Emilia Carranza\nInicio su carrera como actriz en 1958 con una actuacion en la pelicula mexicana Pepito y los robachicos. Más tarde participo en el filme Los hijos del divorcio. Tiene una gran trayectoria en el mundo de las telenovelas, algunos melodramas en los que ha actuado, son: Sor Juana Ines de la Cruz (1962), Encadenada (1962), La gata (1970), El maleficio (1983), Maria la de', 'Pinacoteca Universitaria 25 de noviembre de 2011', 1321315200, 'normal', NULL, 1322179200, '9:30 pm', 'statics/img_eventos/946/cc643ef8a700acf3fa07a88d72ecb3f4.jpg', 0, 2, 'Acredita 3 horas Actividades culturales \nEntrada libre', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(466, 892, '5', '21', 'Yogooooo bailandooo!!!', 'Clases abiertas de baile en el tubo y en la mesa para todo tipo de eventos, impartidas por el bailarín profesional Yogo Yoguin Yogon. No falten se les pondrá una asistencia de 5 horas. La entrada es libre', 'En las mejores instalaciones donde exista un tubo y una mesa!', 1321315200, 'normal', NULL, 1321315200, '12:00 pm', 'statics/img_eventos/946/565314f9478fc88a8cf6740b36f3548b.jpg', 0, 2, '', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(467, 892, '5', '34', 'Taller: Fotografía digital avanzada', '15, 17, 22, 24 y 29 de noviembre\n1, 6 y 8 de diciembre\nAlejandro González, nos invita a participar del alucinante mundo de la fotografía digital en donde se explorarán los conceptos básicos sobre los diferentes modos de la captura digital y que aspectos son los más importantes a tener en cuenta a la hora de pensar en tomar una fotografía que se convertirá en una obra de arte.', 'Museo Universitario de Artes Populares "María Teresa Pomar"', 1321315200, 'normal', NULL, 1323302400, '9:30 pm', 'statics/img_eventos/946/05851c816af4ee837974c1912ce6f125.jpg', 0, 2, 'Acredita 30 horas de actividades culturales, el curso completo\n\nCuota de recuperación $300', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(468, 892, '4', '20', 'Leo…luego existo, Miguel León Govea', 'Miguel León Govea, Nació en 1985 en Colima, México, el cree que definitivamente Colima es un lugar muy tranquilo para nacer. Es egresado de la carrera de Letras Hispanoamericanas en la U de C, y actualmente se dedica a la corrección de estilo. Desde hace algunos años se ha concentrado en la creación literaria, especialmente en la poesía.\n\n ', 'Bachillerato 22, Quesería, Colima 29 de noviembre  10:00 horas', 1321315200, 'normal', NULL, 1322524800, '11:30 am', 'statics/img_eventos/946/c8781cbce6d25d0b4e1bde4007fea960.jpg', 0, 2, '', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(469, 892, '24', '148', 'Bahía 70. Los Beebys en concierto', 'Con un repertorio compuesto principalmente de canciones clásicas como Have you ever seen the rain de Creedence; Clear water revival, House of the rising sun de The Animals; Satisfaction de los Rolling Stone; magical mistery tour de los Beatles, entre otras. la agrupación musical Los Beebys, se presentará el próximo 3 de diciembre en el Teatro Universitario Cnel. Pedro Torres Ortiz, en punto de las', 'Teatro Universitario 3 de diciembre de 2011 /20:30 horas', 1321315200, 'normal', NULL, 1322870400, '10:00 pm', 'statics/img_eventos/946/ac3054360311f080db98bdd3a4c3e7f9.jpg', 0, 2, 'Mayor información en la Dirección General de Arte y Cultura TEL: 31 6 11 77', 0, '0', NULL, 4, 1321315200, NULL, NULL),
(470, 892, '5', '34', 'XVI Taller Práctico de Narrativa ROBERTO VILLA', 'Todos los lunes , a partir del 14 de noviembre y hasta el mes de marzo. \nDe 19:00 a 21:30 horas\nROBERTO VILLA insiste en formar a los mejores lectores y escritores de la región. El taller tendrá sesiones de trabajo los lunes, a partir del 14 de noviembre y hasta el mes de marzo. Desde las 19:00 a 21:30 horas, en instalaciones de la radiodifusora UNIVERSO FM, ubicada en campus central de la Casa de', 'Sala de usos múltiples  radiodifusora UNIVERSO FM, ubicada en campus central de la Casa de Estudios.', 1321315200, 'normal', NULL, 1298937600, '9:30 pm', 'statics/img_eventos/946/a124df3455035cf2b49ed24c90f89867.jpg', 0, 2, '$100 pesos por sesión', 0, '0', NULL, 4, 1321315200, NULL, NULL),
