(537, 892, '5', '31', 'Charlando sobre la impostación de la voz', 'Se valen de su voz –de sus graves perfectos, de las notas impecables—para erizar la piel de los espectadores. El maestro Mario Cortés impartirá el taller “Charlando sobre la impostación de la voz” en sesiones de trabajo que tendrán lugar los días 8, 15, 22 y 29 de noviembre, en punto de las 10:00 de la mañana, en el Foro Pablo Silva García. El taller se suscribe al Programa de Apreciación Artístic', 'Foro Pablo Silva García 8, 15, 22 y 29 de noviembre', 1321920000, 'normal', NULL, 1322524800, '12:00 pm', 'statics/img_eventos/946/ebfa882725d82da9bb50e58726e965af.jpg', 0, 2, '10:00 horas\nEntrada Libre', 0, '0', NULL, 4, 1321920000, NULL, NULL),
