(539, 892, '4', '8', 'Foro Danza Arte Joven: Univerdanza', 'Guiados por el sonido de diversos ritmos como la opera, secondas, clásico jazz, entre otros; y utilizando el cuerpo como medio de expresión, sus integrantes, exponen diversas técnicas de entrenamiento, que derivan de la danza contemporánea.', 'Foro Pablo Silva García  17:00 horas ', 1321920000, 'normal', NULL, 1321920000, '10:00 pm', 'statics/img_eventos/946/3bec7251bc9546662819150ac33388af.jpg', 0, 2, 'Entrada $40 pesos, con 50% para red cultura Ucol.', 0, '0', NULL, 4, 1321920000, NULL, NULL),
(540, 892, '4', '20', 'Sonidos del Vitral: Gala de ópera', 'SCHUMANN y BRAHMS\nMaestros y alumnos del departamento de música del IUBA\nSchumann es el legítimo sucesor de Franz Schubert en el género del Lied (canción alemana). Gracias a él, este género alcanza un grado de perfección y una delicadeza de sentimientos insospechados.\n\nBrahms es reconocido unánimemente como uno de los compositores más importantes en lo que se refiere a la música de cámara, género ', 'Pinacoteca universitaria 20:30 horas', 1321920000, 'normal', NULL, 1321920000, '10:00 pm', 'statics/img_eventos/946/3fc2abee4e11bb87b20868c0798c59d5.jpg', 0, 2, 'Entrada: 60 pesos, con 50% para red cultura Ucol.\n ', 0, '0', NULL, 4, 1321920000, NULL, NULL),
(541, 892, '17', '104', 'Fotojazz Exposición fotográfica de Gonzalo Vidal ', 'Gonzalo Vidal  nos deleitará con la Expo de jazz, es miembro del fondo Cubano de la Imagen Fotográfica, originario de Punta Arenas, Chile. Actualmente reside en La Habana, Cuba.  La cita es el 26 de noviembre a las 19:00 horas. ', 'Pinacoteca Universitaria  19:00 horas Entrada libre', 1321920000, 'normal', NULL, 1322265600, '8:30 pm', 'statics/img_eventos/946/fd60a812095f3574e964a355831e7d97.jpg', 0, 2, '', 0, '0', NULL, 4, 1321920000, NULL, NULL),
(542, 892, '24', '148', 'Ballet Folklórico de la Universidad de Colima  y Ballet Folklórico Infantil Los Niños de Colima', 'El Ballet Folklórico de la Universidad de Colima, con un concepto renovado de la danza folklórica, muestra la cultura popular distintiva de la república mexicana. Las danzas de nuestras primeras civilizaciones y de los contemporáneos son reflejadas en programas distinguidos por excelente técnica, dominio escénico y el ingenio de su creador el Mtro. Rafael Zamarripa Castañeda. El Ballet Folclórico ', 'Teatro Universitario 20:30 horas Función a beneficio de la Cruz Roja Mexicana', 1321920000, 'normal', NULL, 1321920000, '11:00 pm', 'statics/img_eventos/946/00f02ea2b0f93cab0ec4544d35f53869.jpg', 0, 2, 'Entrada $150 pesos 50% de descuento para red cultura Ucol.\nAcredita 5 horas', 0, '0', NULL, 4, 1321920000, NULL, NULL),
