(549, 796, '18', '147', 'El Libro Mágico ', 'Un  par de hermanos  encuentran un libro  mágico que los lleva a vivir  grandes aventuras en los libros  clásicos de todos los tiempos, motivando a los niños de leer y el gusto por la lectura.\nLas funciones son los días 27 de noviembre y 04, 11 y 18 de diciembre del 2011\n\n', 'Teatro Alarife Martin Casillas', 1322006400, 'normal', NULL, 1324166400, '12:00 pm', 'statics/img_eventos/822/3f21421a7c2149b7e96818cff7b771a3.JPG', 0, 2, '', 0, '0', NULL, 4, 1322006400, NULL, NULL),
(550, 796, '5', '27', 'Curso Residuos para recolectores', 'Desmiente SEMADES que se este obligando a los recolectores de residuos de manejo especial a tomar el "Diplomado en Manejo de Residuos Sólidos" a impartirse por ORIENTA\nCurso Residuos para recolectores\nEscénicas Del: 30-nov-2011\nAl: 04-dic-2011\n\n ', 'Orienta', 1322006400, 'normal', NULL, 1322956800, '9:00 am', 'statics/img_eventos/822/e3f74fd8e9bc99951fde57e484fc97a6.jpg', 0, 2, '', 0, '0', NULL, 4, 1322006400, NULL, NULL),
(551, 796, '18', '147', 'Encuentro de la Muerte', 'Del: 26-nov-2011\nAl: 28-nov-2011  Horario: Sábado y Lunes 20:30 horas Domingo 18:00 horas\nInformación adicional y descuentos: Costo para estudiantes, maestros y personas de la tercera edad es de $60 pesos \n ', 'Patio del Exconvento del Carmen', 1322006400, 'normal', NULL, 1322438400, '8:30 pm', 'statics/img_eventos/822/5c165cfb66ddec3b7665159967be140a.jpg', 0, 2, '', 0, '0', NULL, 4, 1322006400, NULL, NULL),
(552, 796, '18', '147', 'CUICO', 'Ramón trabaja como policía, profesión que ha terminado por desdibujar su identidad, supliéndola con uno de los roles sociales más peligrosos y odiados. El "Cuico" un vocablo genuinamente tapatío, comúnmente asociado a connotaciones peyorativas, se encarna en un personaje ambivalente que lucha por salir adelante pese a una historia de vida miserable.', 'Sala Higinio Ruvalcaba del Ex Convento del Carmen ', 1322006400, 'normal', NULL, 1322438400, '8:30 pm', 'statics/img_eventos/822/b5998a4bd0b1caef7b07320533704554.jpg', 0, 2, '', 0, '0', NULL, 4, 1322006400, NULL, NULL),
(554, 796, '18', '147', 'Las Sombras de Beckett', 'Una nueva experiencia escénica  en la que los espectadores son privados de la vista, para que así tengan "alerta" sus sentidos  durante la obra de teatro, esta puesta en escena está bajo la técnica del "Teatro Ciego"\nDel: 26-nov-2011\nAl: 04-dic-2011  Horario: 20:00 horas (sábado) 18:00 horas (domingo)', 'Teatro Alarife Martín Casillas', 1322006400, 'normal', NULL, 1322956800, '8:00 pm', 'statics/img_eventos/822/3fac3606fcb07bd45ec0f45f426e67df.jpg', 0, 2, '', 0, '0', NULL, 4, 1322006400, NULL, NULL),
