(587, 796, '18', '147', 'Concierto para película silente: Faust y Dr. Fanatik ', 'La película clásica del cine silente Faust, del año 1926, trata la antigua temática de Fausto, la cual ya había dado fama mundial a Johann Wolfgang von Goethe: el pacto entre el arcángel Miguel y Mefistófeles y el amor entre Fausto y Gretchen. El director de cine Friedrich Wilhelm Murnau generó este clásico de la historia del cine en la cima de su carrera profesional', 'Expo Guadalajara ', 1322438400, 'normal', NULL, 1322438400, '9:00 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(588, 796, '2', '139', 'El Cine en el Rojo', 'Hasta el Viento tiene Miedo (Carlos Enrique Taboada).', 'Rojo Café 	José Guadalupe Zuno # 2027', 1322438400, 'normal', NULL, 1322438400, '6:30 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(589, 796, '18', '147', 'Noche de Gala con Herta Müller (Premio Nobel 2009)', 'En el marco de la FIL 2011 (invitado Alemania), la ganadora del Nobel acompañada por el actor mexicano Arturo Ríos, dará vida a fragmentos de Todo lo que tengo lo llevo conmigo, una de sus obras más emblemáticas.Una Lectura en compañia de Arturo Ríos.', 'Teatro Diana ', 1322438400, 'normal', NULL, 1322438400, '9:00 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(590, 796, '9', '143', 'XXXV Feria Nacional del Tequila', 'Desfile Inaugural: 26 de noviembre 16:00 hrs. Feria: Todo los días a partir de 19:00 hrs.\nFecha:26 de noviembre al 12 de diciembre 2011.\nVive la mágia de esta tierra.\nLa Feria Nacional de Tequila, que por segunda ocasión consecutiva este año se encuentra ubicada en la unidad deportiva Francisco Javier Sauza Mora al ingreso de la población, se realiza cada último sábado del mes de noviembre hasta e', 'Unidad Deportiva Francisco Javier Sauza Mora (Frente a la Gasolinera al ingreso principal) ', 1322438400, 'normal', NULL, 1323648000, '6:00 pm', 'statics/img_eventos/822/f27fb73420fb8ed9dc5a2c4b51e69d40.JPG', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(591, 796, '18', '147', 'Proyección de la película "X Men"', 'En un futuro cercano, la humanidad comienza a ver aparecer una nueva raza; los mutantes. Dotados de extraños y variados poderes, están agrupados en dos bandos: los que abogan por la integración y el entendimiento con la humanidad, encabezados por el doctor Charles Xavier, y los que buscan el enfrentamiento con una raza que consideran inferior y que les odia, dirigidos por Magnus, alias Magneto, un', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 1322438400, 'normal', NULL, 1323129600, '5:00 pm', 'statics/img_eventos/822/8f758270b62e79f5e2807523d210cf69.jpg', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(592, 796, '18', '147', 'Proyección de video: Traducción ySíntesis', 'La traducción es un recurso creativo muy vasto en sus resultados y su origen lo podemos advertir en la habilidad de sinestesia que poseen o desarrollan algunas personas. Carlos Amorales y Erick Beltrán abordan la riqueza de este recurso en su sistema de producción y el interés que en la estética adquiere. Bruno Estañol habla desde el mundo de la neurología de dicho concepto y de las distintas form', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 1322438400, 'normal', NULL, 1323129600, '6:00 pm', 'statics/img_eventos/822/c61a6bf68cbda3df658acaf8922a9d34.JPG', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(593, 796, '18', '147', 'Proyección de la Película "Batman"', 'Taquillera cinta basada en el héroe de cómic. La oscura y peligrosa ciudad de Gotham tan sólo se halla protegida por su corrupto cuerpo de policía. A pesar de los esfuerzos del fiscal del distrito Harvey Dent y el comisionado de policía Jim Gordon, la ciudad es cada vez más insegura hasta que aparece Batman, el Señor de la Noche. La reputada jornalista Vicky Vale intentará descubrir el secreto que', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 1322438400, 'normal', NULL, 1323734400, '5:00 pm', 'statics/img_eventos/822/e70ccf242a7e1f0a4010671573c31609.jpg', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
