(597, 796, '18', '147', 'Proyección de video: Entre Líneas', 'El concepto de obra abierta es uno de los principales ejes que articulan en el arte contemporáneo; parte de su complejidad es advertir el discurso que subyace en una diversidad de líneas de investigación y procesos productivos. Jonathan Hernández y Enrique Jezik hablan de la manera que construyen sus repertorios visuales y cómo se distancian para enunciar algún asunto de su interés. Diego Lizarazo', 'Sala Guillermo del Toro del Instituto Cultural Cabañas', 1322438400, 'normal', NULL, 1323734400, '6:00 pm', 'statics/img_eventos/822/9d48c47c718b59d469914baa90f6cf13.JPG', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(598, 796, '18', '147', 'Recital de piano a cargo de la maestra Patricia García Torres / Homenaje Franz Liszt', 'Anexo:/wps/wcm/connect/884ac900493057d7affaaf7a9e41262e/liszt.jpg?MOD=AJPERES&CACHEID=884ac900493057d7affaaf7a9e41262e\nInformación adicional y descuentos: Entrada Libre', 'Sala Higinio Ruvalcaba del Ex Convento del Carmen', 1322438400, 'normal', NULL, 1323129600, '8:30 pm', 'statics/img_eventos/822/f3b68cc711e53bab3f7ac8b7b7e90937.jpg', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(599, 796, '18', '147', 'Exposición "Observaciones" de Ricardo Cueriel', '09-dic-2011\nAl: 30-ene-2012\nRicardo Cueriel ha presentado sus obras en diferentes exposiciones colectivas en México y España. De sus exposiciones individuales destacan: Cartografías, en el Museo Gene Byron de Guanajuato y Museo Casa Natal de Morelos en Morelia; micro existencias en el 35° Festival Internacional Cervantino y Continuidad en el Museo Casa Diego Rivera en Guanajuato.\n\n ', 'Ex Convento del Carmen ', 1322438400, 'normal', NULL, 1296345600, '9:00 pm', 'statics/img_eventos/822/bc8ab60b85668a8498e31eaddae71f81.jpg', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL),
(600, 796, '9', '143', 'IV COLOQUIO INTERNACIONAL DE CULTURA CIENTÍFICA', 'El Consejo Estatal de Ciencia y Tecnología de Jalisco tiene el honor de invitar a toda la comunidad al IV COLOQUIO INTERNACIONAL DE CULTURA CIENTÍFICA dentro del marco de la fil 2011.\nEscénicas\nDel: 01-dic-2011\nAl: 02-dic-2011', 'EXPO GUADALAJARA', 1322438400, 'normal', NULL, 1322784000, '6:00 pm', 'statics/img_eventos/822/2de51e47b30dfab8f55f44a76c3dba7f.jpg', 0, 2, '', 0, '0', NULL, 4, 1322438400, NULL, NULL);
