(613, 796, '4', '20', 'DRA y Na’rimbo', 'Christopher Dell, quien ha sido galardonado con numerosos premios, es considerado uno de los primeros vibrafonistas a escala mundial y es el eje central del grupo DRA. Dell, el bajista Christian Ramond y el baterista Félix Astor ponen a prueba los límites de lo rítmicamente posible, en una novedosa experiencia auditiva de carácter muy especial.', 'Expo Guadalajara ', 1322524800, 'normal', NULL, 1322524800, '9:00 pm', '0', 0, 2, '', 0, '0', NULL, 4, 1322524800, NULL, NULL),
(614, 796, '2', '139', 'Virulo Alejandro García', 'Humorista Cubano. Recuperación: $275\nDe visita en nuestra ciudad por actividades de la FIL, el extraordinario humorista cubano, VIRULO, ofrece un concierto íntimo en nuestro foro.', 'Rojo Café 	José Guadalupe Zuno # 2027', 1322524800, 'normal', NULL, 1322524800, '9:00 pm', 'statics/img_eventos/822/d1193c0ada0a8b4f21fd4e40e7691d09.jpg', 0, 2, '', 0, '0', NULL, 4, 1322524800, NULL, NULL),
(615, 796, '12', '145', 'Convocatoria para el desarrollo de "Planes de Acción Climática Municipal (PACMUN)', 'Es un proyecto financiado por la Embajada Británica en México que está siendo lanzado en el país por ICLEI-Gobiernos Locales por la Sustentabilidad con el respaldo técnico e institucional del Instituto Nacional de Ecología (INE) de la Secretaría de Medio Ambiente y Recursos Naturales (SEMARNAT). \nDel: 11-nov-2011\nAl: 07-dic-2011\nPara mayor información respecto a esta convocatoria, escribe a iclei.', '', 1322524800, 'normal', NULL, 1322524800, '12:00 pm', 'statics/img_eventos/822/ca1b388ca25f8151c61764d2174c3f17.jpg', 0, 2, '', 0, '0', NULL, 4, 1322524800, NULL, NULL),
(618, 796, '18', '147', 'El Libro Mágico ', 'Dirige: Rosas Barrera\nEscénicas\nUn  par de hermanos  encuentran un libro  mágico que los lleva a vivir  grandes aventuras en los libros  clásicos de todos los tiempos, motivando a los niños de leer y el gusto por la lectura.', 'Teatro Alarife Martin Casillas', 1322524800, 'normal', NULL, 1322524800, '12:00 pm', 'statics/img_eventos/822/09e9d8683e319317087041ca470cb701.JPG', 0, 2, '', 0, '0', NULL, 4, 1322524800, NULL, NULL),
(619, 796, '18', '147', 'Las Sombras de Beckett', 'Grupo: Colectivo Infinito\nEscénicas\nUna nueva experiencia escénica  en la que los espectadores son privados de la vista, para que así tengan "alerta" sus sentidos  durante la obra de teatro, esta puesta en escena está bajo la técnica del "Teatro Ciego"Del: 26-nov-2011\nAl: 04-dic-2011', 'Teatro Alarife Martín Casillas', 1322524800, 'normal', NULL, 1322956800, '6:00 pm', 'statics/img_eventos/822/543ae25b020a2ab7be81351faa919826.jpg', 0, 2, '', 0, '0', NULL, 4, 1322524800, NULL, NULL),
